clxyfmob001xhzq1dxyy4xfu2	clxyfmc250000zq1d8qzxrvzu	Red Velvet Mug Cake	2024-06-28 08:29:25.26	 ['1 large egg'\n '3 tablespoons vegetable oil'\n '1 teaspoon liquid red food coloring'\n '3 tablespoons buttermilk'\n '2 teaspoons pure vanilla extract'\n '1/4 cup granulated sugar'\n '2 tablespoons unsweetened cocoa powder'\n '1/4 cup self-rising flour'\n 'Pinch of kosher salt'\n '1/4 teaspoon cider\n white\n white wine\n or rice vinegar']	Ingredients:\n ['1 large egg'\n '3 tablespoons vegetable oil'\n '1 teaspoon liquid red food coloring'\n '3 tablespoons buttermilk'\n '2 teaspoons pure vanilla extract'\n '1/4 cup granulated sugar'\n '2 tablespoons unsweetened cocoa powder'\n '1/4 cup self-rising flour'\n 'Pinch of kosher salt'\n '1/4 teaspoon cider\n white\n white wine\n or rice vinegar']\nRecipe:\nIn a large mug, whisk together the egg and oil with a fork. Stir in the food coloring, buttermilk, vanilla, and sugar. Add the cocoa, flour, salt, and vinegar. Beat the batter until smooth. Divide the batter between two mugs. Microwave separately for 1 1/2 to 2 1/2 minutes each until risen and firm.	0
clxyfmoc801xvzq1dtw0p0730	clxyfmc98000pzq1dfus0xi0n	Spicy Jalapeo Sweet Potato Fries	2024-06-28 08:29:25.304	 ['3 medium peeled sweet potatoes'\n '1 tablespoon cornstarch'\n '1/2 teaspoon jalapeo salt'\n 'Vegetable oil cooking spray'\n '1 jalapeo']	Ingredients:\n ['3 medium peeled sweet potatoes'\n '1 tablespoon cornstarch'\n '1/2 teaspoon jalapeo salt'\n 'Vegetable oil cooking spray'\n '1 jalapeo']\nRecipe:\nHeat oven to 425. Cut 3 medium peeled sweet potatoes into 1/4-inch-thick fries. In a bowl, combine 1 tablespoon cornstarch and 1/2 teaspoon jalapeo salt; add fries and toss. Arrange fries on two baking sheets coated with vegetable oil cooking spray; coat with more cooking spray. Bake until fries begin to brown, 10 minutes. Remove from oven and flip; spritz with cooking spray and sprinkle with 1 sliced jalapeo. Bake until golden, 8 minutes.	0
clxyfmocz01y9zq1dfqqb5pnf	clxyfmc98000pzq1dfus0xi0n	Fontina Mac with Squash and Sage	2024-06-28 08:29:25.331	 ['6 tablespoons shredded Parmesan'\n '8 ounces shell pasta'\n '2 tablespoons plus 2 teaspoons butter\n divided'\n '12 whole fresh sage leaves\n plus 2 tablespoons\n finely chopped'\n '2 tablespoons all-purpose flour'\n '3 cups 1 percent milk'\n '1 1/2 pounds butternut squash\n peeled\n seeded and cut into 1/2-inch pieces'\n '2 cloves garlic\n chopped'\n '1/2 tsp salt'\n '2 cups shredded Fontina'\n '1 1/3 cups reduced-fat shredded Swiss cheese'\n '1/4 teaspoon cayenne pepper']	Ingredients:\n ['6 tablespoons shredded Parmesan'\n '8 ounces shell pasta'\n '2 tablespoons plus 2 teaspoons butter\n divided'\n '12 whole fresh sage leaves\n plus 2 tablespoons\n finely chopped'\n '2 tablespoons all-purpose flour'\n '3 cups 1 percent milk'\n '1 1/2 pounds butternut squash\n peeled\n seeded and cut into 1/2-inch pieces'\n '2 cloves garlic\n chopped'\n '1/2 tsp salt'\n '2 cups shredded Fontina'\n '1 1/3 cups reduced-fat shredded Swiss cheese'\n '1/4 teaspoon cayenne pepper']\nRecipe:\nHeat oven to 375. On a parchment paper-lined baking sheet, shape Parmesan into 8 2-inch rounds. Bake until golden, 10 minutes; remove from sheet to cool. Cook pasta as directed on package; set aside. In a medium skillet over medium heat, melt 2 teaspoons butter. Cook whole sage leaves until crisp, 45 seconds. Transfer to a paper towel-lined plate, reserving butter. In the same skillet over medium heat, melt remaining 2 tablespoons butter. Add flour and cook, whisking constantly, until light brown, 1 minute. Slowly whisk in milk and cook, 5 minutes. Add squash, garlic, reserved butter and salt. Cover; simmer until squash is very soft, 25 minutes. In a food processor, puree squash mixture. In a pot over medium-low heat, heat squash puree, Fontina, Swiss, chopped sage and cayenne; stir until cheese melts. Stir in pasta. Serve with Parmesan crisps and sage leaves.	0
clxyfmods01ynzq1dokxcbf4f	clxyfmce6001ezq1dt69bc56c	Hot and Crunchy Avocado Fries	2024-06-28 08:29:25.36	 ['3/4 cup panko breadcrumbs'\n '2 tablespoons ground flax'\n '1 teaspoon mild chili powder'\n '1 egg'\n '2 avocados'\n 'Vegetable oil cooking spray'\n 'Salt'\n 'Hot sauce']	Ingredients:\n ['3/4 cup panko breadcrumbs'\n '2 tablespoons ground flax'\n '1 teaspoon mild chili powder'\n '1 egg'\n '2 avocados'\n 'Vegetable oil cooking spray'\n 'Salt'\n 'Hot sauce']\nRecipe:\nHeat oven to 400. In a bowl, combine 3/4 cup panko breadcrumbs, 2 tablespoons ground flax and 1 teaspoon mild chili powder. In another bowl, whisk 1 egg. Cut 2 peeled avocados into 16 wedges, dip wedges in egg, press into breadcrumb mixture and transfer to a baking sheet. Coat with vegetable oil cooking spray. Bake until outside is crispy, 10 to 12 minutes. Season with salt and drizzle with hot sauce.	0
clxyfmoeu01z1zq1d004msdhn	clxyfmce6001ezq1dt69bc56c	Shrimp Pad Thai For Four	2024-06-28 08:29:25.398	 ['1/3 cup water'\n "4 teaspoons prepared tamarind paste\n preferably unsweetened\n such as Neera's or Rani brands*"\n '1/3 cup palm sugar or packed dark brown sugar'\n '1/3 cup Asian fish sauce (also called nam pla or nuoc mam)'\n '1/4 teaspoon salt'\n '4 1/2 ounces (about 1 1/2 cups) fresh mung bean sprouts'\n '2 limes\n each cut into 6 wedges'\n '1/4 cup salted dry-roasted peanuts\n coarsely chopped'\n '1/3 cup Asian fish sauce (also called nam pla or nuoc mam)'\n '1/3 cup granulated sugar'\n '1/3 cup crushed red pepper'\n 'Boiling water for soaking noodles'\n '12 ounces dried flat rice noodles (slender linguine-width; sometimes called pad thai noodles or stir-fry noodles)'\n '2 tablespoons chopped garlic (about 4 large cloves)'\n '2 tablespoons chopped shallots or onion'\n '12 ounces peeled and deveined small or medium shrimp\n patted dry'\n '3 large eggs\n beaten well'\n '4 1/2 ounces (about 1 1/2 cups) fresh mung bean sprouts'\n '2 bunches scallions\n greens only\n cut into 1-inch pieces (about 1 cup)'\n '1/2 cup salted dry-roasted peanuts\n coarsely chopped'\n '5 tablespoons vegetable oil'\n "*Tamarind paste tends to be a South Asian product; it usually comes in a jar and is available in many supermarkets. Its smooth texture makes it easier and faster to use than the traditional Thai blocks of tamarind pulp that include the fruit's seeds and fibers. Read the label carefully to see if the tamarind paste is sweetened or not; if the jar you purchase contains a sweetener\n just use less sugar in your seasoning sauce."\n 'Equipment: Large wok (preferably a 14-inch flat-bottom carbon-steel wok); large metal spatula or slotted spoon; tongs; small bowls or ramekins for assembling ingredients; colander for draining rice noodles']	Ingredients:\n ['1/3 cup water'\n "4 teaspoons prepared tamarind paste\n preferably unsweetened\n such as Neera's or Rani brands*"\n '1/3 cup palm sugar or packed dark brown sugar'\n '1/3 cup Asian fish sauce (also called nam pla or nuoc mam)'\n '1/4 teaspoon salt'\n '4 1/2 ounces (about 1 1/2 cups) fresh mung bean sprouts'\n '2 limes\n each cut into 6 wedges'\n '1/4 cup salted dry-roasted peanuts\n coarsely chopped'\n '1/3 cup Asian fish sauce (also called nam pla or nuoc mam)'\n '1/3 cup granulated sugar'\n '1/3 cup crushed red pepper'\n 'Boiling water for soaking noodles'\n '12 ounces dried flat rice noodles (slender linguine-width; sometimes called pad thai noodles or stir-fry noodles)'\n '2 tablespoons chopped garlic (about 4 large cloves)'\n '2 tablespoons chopped shallots or onion'\n '12 ounces peeled and deveined small or medium shrimp\n patted dry'\n '3 large eggs\n beaten well'\n '4 1/2 ounces (about 1 1/2 cups) fresh mung bean sprouts'\n '2 bunches scallions\n greens only\n cut into 1-inch pieces (about 1 cup)'\n '1/2 cup salted dry-roasted peanuts\n coarsely chopped'\n '5 tablespoons vegetable oil'\n "*Tamarind paste tends to be a South Asian product; it usually comes in a jar and is available in many supermarkets. Its smooth texture makes it easier and faster to use than the traditional Thai blocks of tamarind pulp that include the fruit's seeds and fibers. Read the label carefully to see if the tamarind paste is sweetened or not; if the jar you purchase contains a sweetener\n just use less sugar in your seasoning sauce."\n 'Equipment: Large wok (preferably a 14-inch flat-bottom carbon-steel wok); large metal spatula or slotted spoon; tongs; small bowls or ramekins for assembling ingredients; colander for draining rice noodles']\nRecipe:\nIn a medium bowl, combine the water, tamarind paste, palm or dark brown sugar, fish sauce, and salt and stir until the sugar is dissolved.\nPlace the bean sprouts, limes, and peanuts each in their own small bowl and arrange near the stove. Place the fish sauce, granulated sugar, and crushed red pepper each in their own small bowl and arrange on the dining table.\nBring a 5-quart saucepan of water to a full, rolling boil. Remove it from the heat and immediately add the rice noodles, making sure they are fully submerged in the water. Let the noodles soak for exactly 3 minutes (use a timer), occasionally lifting them up and pulling them apart as necessary with tongs or a long fork to keep the noodles separate and help them soften evenly. Drain the noodles in a large colander and rinse them under cold running water. (If the noodles become sticky and clumped together while standing, rinse them briefly under cold water just before cooking, so that they return to their slippery, firm, toss-able state.)\nIn a small bowl combine the garlic and shallots. Place the shrimp, beaten eggs, bean sprouts, scallion greens, and peanuts each in their own bowl and arrange near the stove. Have ready 1 clean medium bowl for the cooked shrimp and eggs, and arrange a platter for serving near the stove.\nHeat a large wok over high heat until hot but not smoking. Add 2 tablespoons of the vegetable oil and swirl to coat the pan. (If at any point during cooking the oil starts smoking, lower the heat.) When the oil is hot, scatter in the shrimp. Cook undisturbed until the shrimp begin to change color and firm up, about 30 seconds. Toss well then continue to cook, stirring frequently, until the shrimp are pink, firm and just cooked through, about 30 seconds longer. Using a slotted spoon, transfer the shrimp to the clean bowl.\nAdd the eggs and swirl the pan to spread them into a thin layer. Cook the eggs, lifting the sides and tilting the pan to allow the uncooked eggs to pour underneath as you do when making an omelet, until the eggs are mostly set, 1 to 1 1/2 minutes. Remove the pan from the heat and use the slotted spoon to quickly cut the eggs into bite-size pieces then add them to the bowl of shrimp.\nPlace the wok over high heat and add the remaining 2 tablespoons of vegetable oil, and swirl to coat the pan. Add the garlic and shallots and stir-fry until fragrant, about 5 seconds. Scatter in the softened rice noodles, and using tongs, evenly spread the noodles out across the pan, like a net. Let them cook undisturbed for 15 seconds then scoop them in toward the center. Toss the noodles gently then spread them out again. Pour about 1/3 of the seasoning sauce around the edges of the pan, and continue stir-frying the noodles in the same manner, spreading them out and letting them cook undisturbed occasionally, until most of the sauce is absorbed, about 30 seconds more.\nAdd another third of the sauce and continue to stir-fry in the same manner until most of the sauce is absorbed and the noodles are just tender but not mushy, about 30 seconds. Test a noodle or two: If they are too firm, add 2 to 4 tablespoons of water around the edge of the pan, and continue stir-frying until they are just tender and evenly coated with the sauce.\nReturn the shrimp and eggs to the pan, along with any juices collected in the bottom of the bowl, and toss to incorporate them into the noodles. Add the remaining third of the seasoning sauce, along with the bean sprouts, scallion greens, and chopped peanuts, and cook, tossing, until they are mixed in and barely heated, about 30 seconds.\nQuickly transfer the noodles onto the platter, mounding them at one end. Mound the reserved bean sprouts next to the noodles, and arrange the reserved lime wedges next to the bean sprouts. Sprinkle the peanuts on the noodles in a stripe next to the bean sprouts. Serve hot with the small bowls of fish sauce, sugar, and crushed red pepper so that guests can flavor their portions to taste.	0
clxyfmol9021dzq1d8opc1k8u	clxyfmd090046zq1d1cijkc42	Perfect Pork Chops	2024-06-28 08:29:25.629	 ['4 pork chops'\n 'Salt and freshly ground black pepper'\n 'N/A freshly ground black pepper'\n '3 tablespoons olive oil'\n '2 shallots\n diced'\n '2 tablespoons butter'\n '2 cups white cooking wine'\n '3 tablespoons Dijon mustard'\n '1 tablespoon blackstrap molasses\n maple syrup\n or honey']	Ingredients:\n ['4 pork chops'\n 'Salt and freshly ground black pepper'\n 'N/A freshly ground black pepper'\n '3 tablespoons olive oil'\n '2 shallots\n diced'\n '2 tablespoons butter'\n '2 cups white cooking wine'\n '3 tablespoons Dijon mustard'\n '1 tablespoon blackstrap molasses\n maple syrup\n or honey']\nRecipe:\nMAKE IT: Season both sides of the pork chops with salt and pepper to taste and drizzle with the olive oil. Set the chops, covered, on the counter for 1 hour before preparing the dish to bring them to room temperature. In a large skillet over medium heat, cook the shallots in butter until translucent. Add the wine, mustard, and molasses, syrup, or honey to the shallots and stir. Cook for 3 minutes, then add the pork chops and cover. Simmer for 25 minutes and remove from heat. To serve, let the pork chops rest for 5 minutes and then slice thinly and spoon the sauce over the top.	0
clxyfmofn01zfzq1djhlou45o	clxyfmckd0023zq1dumkw5wy0	Chunky Red Chili	2024-06-28 08:29:25.427	 ['3 tablespoons olive oil'\n '1 pound ground beef'\n '1 pound beef stew meat\n cut into 1/2 inch chunks'\n '1 large onion\n coarsely chopped'\n '1 medium green bell pepper\n ribs and seeds removed\n coarsely chopped'\n 'One 28-ounce can whole plum tomatoes\n drained'\n 'One 8-ounce can tomato sauce'\n 'One 15 1/2 ounce can red kidney beans\n rinsed and drained'\n 'One 15 1/2 ounce can black beans\n rinsed and drained'\n '3 tablespoons packed light brown sugar'\n '2 tablespoons Worcestershire sauce'\n '2 tablespoons red wine vinegar'\n '1 tablespoon chili powder'\n '2 teaspoons dried basil'\n '2 teaspoons ground cumin'\n '2 teaspoons kosher salt'\n '2 bay leaves'\n 'Tortilla chips\n for serving (optional)']	Ingredients:\n ['3 tablespoons olive oil'\n '1 pound ground beef'\n '1 pound beef stew meat\n cut into 1/2 inch chunks'\n '1 large onion\n coarsely chopped'\n '1 medium green bell pepper\n ribs and seeds removed\n coarsely chopped'\n 'One 28-ounce can whole plum tomatoes\n drained'\n 'One 8-ounce can tomato sauce'\n 'One 15 1/2 ounce can red kidney beans\n rinsed and drained'\n 'One 15 1/2 ounce can black beans\n rinsed and drained'\n '3 tablespoons packed light brown sugar'\n '2 tablespoons Worcestershire sauce'\n '2 tablespoons red wine vinegar'\n '1 tablespoon chili powder'\n '2 teaspoons dried basil'\n '2 teaspoons ground cumin'\n '2 teaspoons kosher salt'\n '2 bay leaves'\n 'Tortilla chips\n for serving (optional)']\nRecipe:\n1. Heat 1 tablespoon of the olive oil in a large pot or Dutch oven over medium-high heat. Add ground beef and cook, breaking up the beef, until nicely browned, about 8 minutes. Remove the ground beef with a slotted spoon and set aside in a large bowl or place. Pour another tablespoon of oil into the pot; when hot, add the stew meat and cook until nicely browned on all side, about 8 minutes. Remove the stew meat with a slotted spoon and add it to the ground beef. Pour off the fat and any accumulated juices from the pot.\n2. Heat the remaining 1 tablespoon oil. Add the onion and pepper, and cook until slightly softened, about 4 minutes. Return the meats to the pot and add the tomatoes, tomato sauce, kidney beans, black beans, sugar, Worcestershire, vinegar, chili powder, basil, cumin, salt, and bay leaves. Stir well to mix, breaking up the whole tomatoes with the back of a wooden spoon. Bring to a boil, reduce the heat to a simmer, and cook, covered, until the stew meat is soft, about 2 hours. Remove and discard the bay leaves. Divide the chili among 8 bowls and serve warm, with chips on the side, if you like.	0
clxyfmoh401ztzq1d7wjrentd	clxyfmckd0023zq1dumkw5wy0	Basic Pull-Apart Challah	2024-06-28 08:29:25.479	 ['2 ounces (1/4 cup) active dry yeast'\n '2 cups plus 3 tablespoons granulated sugar'\n '6 cups warm water (90 to 100F)'\n '1/4 cup kosher salt'\n '6 pounds high-gluten (bread) or all-purpose flour'\n '4 large eggs\n separated'\n '1 1/4 cups canola oil'\n 'Cooking spray'\n '1/2 cup sesame seeds'\n '1/2 cup poppy seeds']	Ingredients:\n ['2 ounces (1/4 cup) active dry yeast'\n '2 cups plus 3 tablespoons granulated sugar'\n '6 cups warm water (90 to 100F)'\n '1/4 cup kosher salt'\n '6 pounds high-gluten (bread) or all-purpose flour'\n '4 large eggs\n separated'\n '1 1/4 cups canola oil'\n 'Cooking spray'\n '1/2 cup sesame seeds'\n '1/2 cup poppy seeds']\nRecipe:\n1. Bloom the yeast: Dissolve the yeast and 3 tablespoons sugar in 2 cups of the warm water in a medium bowl; set aside to bloom. If the yeast doesn't bloom after 5 minutes discard the mixture and start over.\n2. Place the salt, flour, and the remaining 2 cups sugar together in a very large bowl and stir together. Add the 4 egg yolks. Make a well in the middle and add the yeast mixture and the remaining 4 cups water. Start kneading together; add 1/2 cup canola oil. Knead for 10 minutes, adding 1/2 cup canola oil, a small amount at a time, to create a workable dough. The dough will become a cohesive mass yet be a bit sticky. Rub a little of the remaining 1/4 cup canola oil over the top and sides of the dough. Loosely cover the dough with a kitchen towel and place the bowl in a warm spot for 15 minutes.\n3. After 15 minutes, the dough will have relaxed a bit and should be easier to work with. Lightly oil your hands and knead the dough again until smooth and satiny, 2 to 3 minutes. Rub a little oil over the top and sides of the dough. Cover with a kitchen towel and place the bowl in a medium garbage bag. Place the open end loosely underneath the bowl to trap air. Let the dough rise in a warm dark corner of your kitchen until doubled in size, about 1 hour.\n4. Uncover the dough. With lightly oiled hands, punch the dough down to release air. Cover again with the bag, loosely tucked under, and let rise for 1 hour.\n5. Divide the dough into five equal parts, about 2 pounds each. Preheat oven to 375F. Spray five 9-inch round baking pans with cooking spray.\n6. Place one piece of dough on a smooth work surface. Squeeze out any air bubbles from the dough and roll in into a 12-inch rope. If the dough is sticking, lightly spray your work surface with cooking spray. Cut the rope into eight equal pieces. Roll each piece into a ball. Place one ball in the center of the prepared pan and surround it with the remaining balls. Repeat with the remaining pieces of dough so you have five pans of challah. Loosely cover each pan with a kitchen towel or plastic wrap and let rise 15 minutes. (If you can't fit all the pans in your oven at once and you want your challahs to be as beautiful as possible, shape the remaining dough while the first round of challahs are in the oven so they don't see rise for too much longer than 15 minutes before baking.)\n7. Beat the egg whites with 1 teaspoon water in a small bowl and brush the challahs. Sprinkle each with sesame or poppy seeds or a combination of the two.\n8. Bake for 10 minutes. Reduce the temperature to 350F and bake until tops are dark golden brown, 35 to 45 minutes more. Let cool 15 minutes before serving warm, or cool completely on a wire rack.	0
clxyfmoid0207zq1dlyaiw6kx	clxyfmcpe002szq1d1w5616kd	Shrimp Pad Thai for Two	2024-06-28 08:29:25.525	 ['3 tablespoons water'\n "2 teaspoons prepared tamarind paste\n preferably unsweetened\n such as Neera's or Rani brands*"\n '3 tablespoons palm sugar or packed dark brown sugar'\n '3 tablespoons Asian fish sauce (also called nam pla or nuoc mam)'\n '1/8 teaspoon salt'\n '3 ounces (about 1 cup) fresh mung bean sprouts'\n '2 limes\n cut into wedges'\n '3 tablespoons salted dry-roasted peanuts\n coarsely chopped'\n '1/4 cup Asian fish sauce (also called nam pla or nuoc mam)'\n '1/4 cup granulated sugar'\n '1/4 cup crushed red pepper'\n 'Boiling water for soaking noodles'\n '6 ounces dried flat rice noodles (slender\n linguine-width; sometimes called pad thai noodles or stir-fry rice noodles)'\n '1 tablespoon chopped garlic (about 2 large cloves)'\n '1 tablespoon chopped shallot or onion'\n '6 ounces peeled and deveined small or medium shrimp\n patted dry'\n '2 large eggs\n beaten well'\n '3 ounces (about 1 cup) fresh mung bean sprouts'\n '1 bunch scallions\n greens only\n cut into 1-inch pieces (1/2 cup)'\n '1/3 cup salted dry-roasted peanuts\n coarsely chopped'\n '3 tablespoons vegetable oil'\n "*Tamarind paste tends to be a South Asian product; it usually comes in a jar and is available in many supermarkets. Its smooth texture makes it easier and faster to use than the traditional Thai blocks of tamarind pulp that include the fruit's seeds and fibers. Read the label carefully to see if the tamarind paste is sweetened or not; if the jar you purchase contains a sweetener\n just use less sugar in your seasoning sauce."\n 'Equipment: 12-inch heavy\n deep skillet or saut pan\n or a large wok (preferably a 14-inch flat-bottom carbon-steel wok); large metal spatula or slotted spoon; tongs; small bowls or ramekins for assembling ingredients; colander for draining rice noodles']	Ingredients:\n ['3 tablespoons water'\n "2 teaspoons prepared tamarind paste\n preferably unsweetened\n such as Neera's or Rani brands*"\n '3 tablespoons palm sugar or packed dark brown sugar'\n '3 tablespoons Asian fish sauce (also called nam pla or nuoc mam)'\n '1/8 teaspoon salt'\n '3 ounces (about 1 cup) fresh mung bean sprouts'\n '2 limes\n cut into wedges'\n '3 tablespoons salted dry-roasted peanuts\n coarsely chopped'\n '1/4 cup Asian fish sauce (also called nam pla or nuoc mam)'\n '1/4 cup granulated sugar'\n '1/4 cup crushed red pepper'\n 'Boiling water for soaking noodles'\n '6 ounces dried flat rice noodles (slender\n linguine-width; sometimes called pad thai noodles or stir-fry rice noodles)'\n '1 tablespoon chopped garlic (about 2 large cloves)'\n '1 tablespoon chopped shallot or onion'\n '6 ounces peeled and deveined small or medium shrimp\n patted dry'\n '2 large eggs\n beaten well'\n '3 ounces (about 1 cup) fresh mung bean sprouts'\n '1 bunch scallions\n greens only\n cut into 1-inch pieces (1/2 cup)'\n '1/3 cup salted dry-roasted peanuts\n coarsely chopped'\n '3 tablespoons vegetable oil'\n "*Tamarind paste tends to be a South Asian product; it usually comes in a jar and is available in many supermarkets. Its smooth texture makes it easier and faster to use than the traditional Thai blocks of tamarind pulp that include the fruit's seeds and fibers. Read the label carefully to see if the tamarind paste is sweetened or not; if the jar you purchase contains a sweetener\n just use less sugar in your seasoning sauce."\n 'Equipment: 12-inch heavy\n deep skillet or saut pan\n or a large wok (preferably a 14-inch flat-bottom carbon-steel wok); large metal spatula or slotted spoon; tongs; small bowls or ramekins for assembling ingredients; colander for draining rice noodles']\nRecipe:\nIn a medium bowl, combine the water, tamarind paste, palm or dark brown sugar, fish sauce, and salt and stir until the sugar is dissolved.\nPlace the bean sprouts, limes, and peanuts each in their own small bowl and arrange near the stove. Place the fish sauce, granulated sugar, and crushed red pepper each in their own small bowl and arrange on the dining table.\nBring a 3-quart saucepan of water to a full, rolling boil. Remove it from the heat and immediately add the rice noodles, making sure they are fully submerged in the water. Let the noodles soak for exactly 3 minutes (use a timer), occasionally lifting them up and pulling them apart as necessary with tongs or a long fork to keep the noodles separate and help them soften evenly. Drain the noodles in a large colander and rinse them under cold running water. (If the noodles become sticky and clumped together while standing, rinse them briefly under cold water just before cooking, so that they return to their slippery, firm, toss-able state.)\nIn a small bowl, combine the garlic and shallot. Place the shrimp, beaten eggs, bean sprouts, scallion greens, and peanuts each in their own bowl and arrange near the stove. Have ready 1 clean medium bowl for the cooked shrimp and eggs, and arrange a large plate or platter for serving near the stove.\nHeat a 12-inch heavy, deep skillet or saut pan or a large wok over high heat until hot but not smoking. (If at any point during cooking the oil starts smoking, lower the heat.) Add 1 tablespoon of the vegetable oil and swirl to coat the pan. When the oil is hot, scatter in the shrimp. Cook undisturbed until the shrimp begin to change color and firm up, about 30 seconds. Toss well then continue to cook, stirring frequently, until the shrimp are pink, firm, and just cooked through, about 30 seconds longer. Using a slotted spoon, transfer the shrimp to the clean bowl.\nAdd the eggs and swirl the pan to spread them into a thin layer. Cook the eggs, lifting the sides and tilting the pan to allow the uncooked eggs to pour underneath as you would do with an omelet, until the eggs are mostly set, about 1 minute. Remove the pan from the heat and use the slotted spoon to quickly cut the eggs into bite-size pieces, then add them to the bowl of shrimp.\nPlace the pan over high heat and add the remaining 2 tablespoons of the vegetable oil, swirling the pan to coat it evenly (if at any point during cooking the oil starts smoking, lower the heat). Add the garlic and shallot and stir-fry until fragrant, about 5 seconds. Scatter in the softened rice noodles, and, using tongs, evenly spread the noodles out across the pan, like a net. Let them cook undisturbed for 15 seconds then scoop them in toward the center. Toss the noodles gently then spread them out again. Pour about 1/3 of the seasoning sauce around the edges of the pan, and continue stir-frying the noodles in the same manner, spreading them out and letting them cook undisturbed occasionally, until most of the sauce is absorbed, about 30 seconds more.\nAdd another third of the sauce and continue to stir-fry in the same manner until most of the sauce is absorbed and the noodles are just tender but not mushy, about 30 seconds. Test a noodle or two: If they are too firm, add about 2 tablespoons of water around the edge of the pan, and continue stir-frying until they are just tender and evenly coated with the sauce.\nReturn the shrimp and eggs to the pan, along with any juices collected in the bottom of the bowl, and toss to incorporate them into the noodles. Add the remaining third of the seasoning sauce, along with the bean sprouts, scallion greens, and chopped peanuts, and cook, tossing, until they are mixed in and barely heated, about 30 seconds.\nQuickly transfer the noodles to the platter, mounding them at one end. Mound the reserved bean sprouts next to the noodles, and arrange the reserved lime wedges next to the bean sprouts. Sprinkle the peanuts on the noodles in a stripe next to the bean sprouts. Serve hot, passing the small bowls of fish sauce, sugar, and crushed red pepper so that guests can flavor their portions to taste.	0
