clxyfmp1p0277zq1dxzusvbv1	clxyfme9v00afzq1dsb2mdotq	Bo Ssm	2024-06-28 08:29:26.221	 ['1 whole 8- to 10-pound bone-in Boston pork butt'\n '1 cup granulated sugar'\n '1 cup plus 1 tablespoon kosher salt'\n '7 tablespoons light brown sugar'\n '1 dozen oysters\n shucked'\n '1 cup Napa Cabbage Kimchi\n plus 1 cup pured'\n '1 cup Ginger Scallion Sauce'\n 'Ssm Sauce'\n '2 cups Short-Grain Rice'\n '3 to 4 heads Bibb lettuce\n leaves separated\n well washed\n and spun dry'\n 'Maldon or other high-quality coarse sea salt']	Ingredients:\n ['1 whole 8- to 10-pound bone-in Boston pork butt'\n '1 cup granulated sugar'\n '1 cup plus 1 tablespoon kosher salt'\n '7 tablespoons light brown sugar'\n '1 dozen oysters\n shucked'\n '1 cup Napa Cabbage Kimchi\n plus 1 cup pured'\n '1 cup Ginger Scallion Sauce'\n 'Ssm Sauce'\n '2 cups Short-Grain Rice'\n '3 to 4 heads Bibb lettuce\n leaves separated\n well washed\n and spun dry'\n 'Maldon or other high-quality coarse sea salt']\nRecipe:\n1. Put the pork in a roasting pan, ideally one that holds it snugly. Mix together the granulated sugar and 1 cup of the salt in a bowl, then rub the mixture into the meat; discard any excess salt-and-sugar mixture. Cover the pan with plastic wrap and put it into the fridge for at least 6 hours, or overnight.\n2. Heat the oven to 300F. Remove the pork from the refrigerator and discard any juices that have accumulated. Put the pork in the oven and cook for 6 hours, basting with the rendered fat and pan juices every hour. The pork should be tender and yielding at this pointit should offer almost no resistance to the blade of a knife and you should be able to easily pull meat off the shoulder with a fork. Depending on your schedule, you can serve the pork right away or let it rest and mellow out at room temperature for up to an hour.\n3. When ready to servesauces are made, oysters are ready to be shucked, lettuce is washed, etc.turn the oven to 500F.\n4. Stir together the remaining 1 tablespoon salt and the brown sugar and rub the mixture all over the pork. Put it in the oven for 10 to 15 minutes, until the sugar has melted into a crisp, sweet crust.\n5. Serve bo ssm whole and hot, surrounded by the accompaniments.	0
