clxyfmt0x03mjzq1dst2yn01i	clxyfmo5k01w2zq1dimz41nqr	Korean Steak Tacos	2024-06-28 08:29:31.376	 ['1/2 cup finely chopped fresh cilantro'\n '1/4 cup packed dark brown sugar'\n '3 tablespoons canola oil'\n '3 tablespoons soy sauce'\n '1 tablespoon toasted sesame oil'\n '2 large garlic cloves\n minced'\n '1 jalapeo pepper\n seeded and finely chopped'\n '1 teaspoon freshly ground black pepper'\n '1 teaspoon ground coriander'\n 'One 2-pound flank steak (about 1 1/2 inches thick)\n fat trimmed'\n '1/2 head napa cabbage\n halved lengthwise and shredded crosswise (about 3 cups)'\n '1 large carrot\n cut into 2-inch-long matchstick-size strips'\n '8 scallions (white and green parts)\n thinly sliced on a sharp diagonal'\n '1/2 cup lightly packed fresh cilantro sprigs'\n 'Twelve 6-inch corn tortillas'\n 'Guacamole for Lindsay']	Ingredients:\n ['1/2 cup finely chopped fresh cilantro'\n '1/4 cup packed dark brown sugar'\n '3 tablespoons canola oil'\n '3 tablespoons soy sauce'\n '1 tablespoon toasted sesame oil'\n '2 large garlic cloves\n minced'\n '1 jalapeo pepper\n seeded and finely chopped'\n '1 teaspoon freshly ground black pepper'\n '1 teaspoon ground coriander'\n 'One 2-pound flank steak (about 1 1/2 inches thick)\n fat trimmed'\n '1/2 head napa cabbage\n halved lengthwise and shredded crosswise (about 3 cups)'\n '1 large carrot\n cut into 2-inch-long matchstick-size strips'\n '8 scallions (white and green parts)\n thinly sliced on a sharp diagonal'\n '1/2 cup lightly packed fresh cilantro sprigs'\n 'Twelve 6-inch corn tortillas'\n 'Guacamole for Lindsay']\nRecipe:\n1. To marinate the steak: In a large baking dish, whisk the cilantro, brown sugar, canola oil, soy sauce, sesame oil, garlic, jalapeos, black pepper, and coriander to blend well. Reserve 1/4 cup of the mixture in a small bowl for serving. Place the steak in the remaining marinade and turn to coat. Marinate for at least 20 minutes at room temperature, or cover and refrigerate for up to 1 day, turning occasionally. Cover and refrigerate the reserved marinade.\n2. Prepare an outdoor grill for medium-high cooking over direct heat.\n3. Remove the steak from the marinade (discard the marinade) and grill, turning halfway through cooking, for a total of about 10 minutes, until the meat feels only slightly resilient when pressed with a fingertip for medium-rare. Transfer the steak to a cutting board and let stand for 5 to 10 minutes.\n4. Meanwhile, prepare the tacos: In a large bowl, toss the cabbage, carrots, scallions, and cilantro together.\n5. Heat the tortillas on the grill, turning occasionally, for about 1 minute, or until hot. Transfer to a serving bowl and cover to keep warm.\n6. To serve: Cut the steak across the grain into 1/4-inch-thick slices. Transfer the steak slices and any carving juices to a platter. Serve the steak with the reserved marinade, tortillas, cabbage mixture, and guacamole. Let each guest fill two tortillas with some steak and cabbage mixture and top with some of the marinade and guacamole.	0
clxyfmopd022xzq1deub28kk9	clxyfmda4005kzq1dj6j6wis6	Tropical Fruit and Cake Trifle	2024-06-28 08:29:25.776	 ['1 package (3.4 ounces) vanilla pudding'\n 'Vegetable oil cooking spray'\n '1 1/2 cups sugar\n divided'\n '1 cup cake flour\n sifted'\n '1/8 teaspoon salt'\n '12 large egg whites (or 2 1/2 cups store-bought egg whites)'\n '1/2 teaspoon cream of tartar'\n '1/2 cup peach jam'\n '1/2 cup shredded coconut'\n '1 1/2 cups heavy cream'\n '1/2 teaspoon coconut extract'\n '8 cups fruit\n such as mango\n papaya\n kiwi\n strawberries\n banana\n cut into 1-inch pieces']	Ingredients:\n ['1 package (3.4 ounces) vanilla pudding'\n 'Vegetable oil cooking spray'\n '1 1/2 cups sugar\n divided'\n '1 cup cake flour\n sifted'\n '1/8 teaspoon salt'\n '12 large egg whites (or 2 1/2 cups store-bought egg whites)'\n '1/2 teaspoon cream of tartar'\n '1/2 cup peach jam'\n '1/2 cup shredded coconut'\n '1 1/2 cups heavy cream'\n '1/2 teaspoon coconut extract'\n '8 cups fruit\n such as mango\n papaya\n kiwi\n strawberries\n banana\n cut into 1-inch pieces']\nRecipe:\nMake pudding as directed on package. Heat oven to 350. Line a 13" x 17" baking pan with parchment paper; coat with cooking spray. In a bowl, combine 3/4 cup sugar, flour and salt. In another bowl, beat egg whites with an electric mixer until foamy. Add cream of tartar; beat until soft peaks form. Slowly add remaining 3/4 cup sugar, beating until mixture is thick and shiny. Fold flour mixture into egg mixture in four batches; spread batter in pan. Bake until golden, 20 to 25 minutes. Loosen sides of cake with a knife; let cool. In a bowl, microwave jam for 30 seconds. Invert cake on cutting board; spread with jam and cut into 2-inch squares. In a nonstick pan over medium-high heat, toast coconut, stirring, 4 minutes. In another bowl, beat cream and coconut extract with an electric mixer until peaks form. Reserve 1/4 cup whipped cream. Fold pudding and 1/4 cup coconut into remaining whipped cream. In a large glass bowl, assemble trifle: Layer 1/3 cake squares, 1/3 fruit and 1/3 pudding mixture; repeat twice. Top with remaining 1/4 cup whipped cream and 1/4 cup coconut.	0
