t for 15 minutes, or until the cut sections on the bottoms of the nuts just start to curl. Peel the chestnuts as soon as they are cool enough to handle, as they will peel the easiest when hot. Cut into quarters and set aside.\nReduce the oven temperature to 350F. Wrap the shallots in parchment paper and then in aluminum foil. Bake until tender and slightly caramelized, about 1 hour. Once the shallots are cool enough to handle, chop coarsely and set aside.\nTo make the vinaigrette: In a large saut pan, cook the bacon over medium heat until crispy; transfer the bacon to a paper towel-lined plate and reserve the fat in the pan. Once the fat has cooled slightly, strain through a fine-mesh strainer into a measuring cup that has a spout. in a blender or food processor, combine the mustard, honey, vinegar, thyme, and pepper and blend for 30 seconds. Slowly add the strained warm bacon fat and the oil through the cap of the blender or the feed tube of a food processor, blending until thoroughly combined Pour the vinaigrette into a large mixing bowl.\nAdd the squash and pears, chestnuts, shallots, bacon, komatsuna, tatsoi, and mustard greens to the mixing bowl and toss with the warm vinaigrette. Serve immediately.	0
