es. Mix in 1/4 cup Pecorino; season with salt and pepper.\nServe pasta topped with reserved pancetta and sage, shaved Pecorino, and more pepper.\nDO AHEAD: Squash pure can be made 3 days ahead. Let cool; cover and chill.	0
