e into each quail body and tie the legs together with butcher's twine.\nHeat a large cast-iron or heavy-bottomed ovenproof saut pan over medium heat. Add the remaining 1 tablespoon oil and brown the quail on all sides. You may need to work in batches. Transfer the pan to the oven (use two pans or transfer to a large roasting pan if necessary) and roast the quail for 30 minutes, or until a meat thermometer inserted in the center of the quail registers 155F. Let rest in the pan for 5 minutes before serving.	0
