er medium-high heat.) Drizzle cabbage, white onion, and scallions with 4 tablespoons oil; season with salt and pepper. Grill, turning occasionally, until vegetables are charred and softened, about 4 minutes for scallions, 1012 minutes for cabbage and onion. Let vegetables cool slightly.\nCore cabbage and cut into bite-size pieces along with scallions and onion. Toss chopped vegetables in a large bowl with red onion, lime juice, cilantro, and remaining 2 tablespoons oil; season with salt and pepper.\nRemove steak from marinade, scraping off excess; season with salt and pepper. Grill steak until medium-rare, about 3 minutes per side. Transfer to a cutting board and let rest 510 minutes before slicing. Serve steak with vegetables, tortillas, and Dried Chile Salsa.	0
