clxyfmqni02slzq1d1iga1h1r	clxyfmiir00zfzq1d4vjw6ggf	Indian-Spiced Chicken With Tomato and Cream	2024-06-28 08:29:28.302	 ['3 tablespoons ghee (clarified butter) or vegetable oil'\n '6 chicken legs (drumsticks with thighs; about 3 pounds)'\n 'Kosher salt'\n 'freshly ground pepper'\n '1 medium onion\n finely chopped'\n '4 garlic cloves\n finely grated'\n '2 tablespoons finely grated peeled ginger'\n '2 tablespoons tomato paste'\n '2 teaspoons garam masala'\n '2 teaspoons ground cumin'\n '2 teaspoons ground turmeric'\n '1 1/2 teaspoons ground coriander'\n '3/4 teaspoon cayenne pepper'\n '3/4 teaspoon ground cardamom'\n '8 cups low-sodium chicken broth'\n '3/4 cup canned tomato pure'\n '1/2 cup heavy cream'\n '1 pound small Yukon Gold potatoes\n sliced 1/4" thick'\n 'Plain yogurt\n torn fresh mint\n and naan\n flatbread\n or cooked rice (for serving)']	Ingredients:\n ['3 tablespoons ghee (clarified butter) or vegetable oil'\n '6 chicken legs (drumsticks with thighs; about 3 pounds)'\n 'Kosher salt'\n 'freshly ground pepper'\n '1 medium onion\n finely chopped'\n '4 garlic cloves\n finely grated'\n '2 tablespoons finely grated peeled ginger'\n '2 tablespoons tomato paste'\n '2 teaspoons garam masala'\n '2 teaspoons ground cumin'\n '2 teaspoons ground turmeric'\n '1 1/2 teaspoons ground coriander'\n '3/4 teaspoon cayenne pepper'\n '3/4 teaspoon ground cardamom'\n '8 cups low-sodium chicken broth'\n '3/4 cup canned tomato pure'\n '1/2 cup heavy cream'\n '1 pound small Yukon Gold potatoes\n sliced 1/4" thick'\n 'Plain yogurt\n torn fresh mint\n and naan\n flatbread\n or cooked rice (for serving)']\nRecipe:\nHeat ghee in a large Dutch oven over medium heat. Season chicken with salt and pepper. Working in batches, cook chicken, skin side down, until golden brown (do not turn), 810 minutes. Transfer to a plate.\nAdd onion, garlic, and ginger to pot and cook, stirring occasionally, until onion is very soft and golden brown, 810 minutes. Add tomato paste, garam masala, cumin, turmeric, coriander, cayenne, and cardamom and cook, stirring often, until tomato paste is beginning to darken, about 4 minutes.\nAdd chicken, broth, tomato pure, and cream to pot; season with salt and pepper. Bring to a boil, reduce heat, and simmer, partially covered, skimming occasionally, until chicken is almost falling off the bone and liquid is slightly thickened, 1 1/22 hours.\nAdd potatoes to pot and cook, partially covered, until potatoes are fork-tender, chicken is falling off the bone, and liquid is thick enough to coat a spoon, 3045 minutes. Remove skin and bones from chicken, if desired, and return meat to pot; season stew with salt and pepper.\nDivide stew among bowls, top with yogurt and mint, and serve with naan, flatbread, or rice.\nDO AHEAD: Stew can be made 3 days ahead. Let cool; cover and chill.	0
