il the whites are set and the yolks are still very soft to the touch, 3 to 4 minutes.\nMeanwhile, using tongs, toast each tortilla directly over high heat until beginning to blacken in spots, about 15 seconds per side. Put the warm tortillas on plates. Spoon 1 tablespoon of hummus on each tortilla and spread to cover, leaving a 1-inch border. Divide the kale mixture over the hummus.\nUsing a slotted spoon, lift each egg from the water, wiping excess liquid from the bottom of the spoon with paper towels. Put the eggs on top of the kale. Slit the yolks and press on the eggs a bit so the yolks begin to run (this will make them easier to eat). Fold up the bottom of each tortilla and then fold in the sides, leaving the wraps open at the top. Serve.	0
