tems, and seeds, if you prefer less heat. Place chiles, half of yellow onion, remaining garlic, and 1 cup hot water in a blender; let sit 10 minutes to soften chiles. Blend until smooth; set chile pure aside.\nHeat oil in a large Dutch oven over medium-high heat. Working in batches, cook pork, turning occasionally, until browned, 810 minutes; transfer to a plate.\nPour off fat from pot. Cook chile pure in pot over medium-high heat, stirring occasionally, until reduced by half, 810 minutes. Add pork, oregano, remaining yellow onion, and 10 cups water to pot; season with salt and pepper. Bring to a boil, reduce heat, and simmer, partially covered, skimming occasionally, until pork is very tender, 33 1/2 hours.\nAdd squash to stew and cook, uncovered, until pork is falling apart and squash is soft, 3035 minutes; season with salt and pepper.\nToss red onion and lime juice in a small bowl; let sit, tossing occasionally, 30 minutes.\nServe stew with red onion, cilantro, and reserved pumpkin seeds.\nDO AHEAD: Pork can be marinated 2 days ahead; keep chilled. Stew can be made 3 days ahead; let cool, then cover and chill.	0
