r, cover the pot, and bring the mixture to a boil, whisking occasionally. Using a heatproof rubber spatula, push any seeds clinging to the side of the pot into the liquid, then reduce the heat to low and continue to simmer, covered, until the liquid is absorbed, 20 to 25 minutes. Stir in 1 teaspoon salt, or to taste. Remove the pot from the heat and let the amaranth stand, covered, 5 to 10 minutes.\nWhile the amaranth is simmering, in a 12-inch heavy skillet over moderate heat, melt 1 tablespoon of the remaining butter with the remaining 1 tablespoon oil. Add the garlic and cook, stirring, for 30 seconds. Add the reserved porcini mushrooms, along with the fresh sliced mushrooms, the remaining 1/2 teaspoon salt, and the soy sauce and saut until the mushrooms are softened and juicy, 8 to 10 minutes. Add the sherry and continue to saut until the mushrooms are tender, about 2 minutes. Season with salt and freshly ground black pepper.\nRemove the pan from the heat then stir in the thyme. Cut the remaining 4 tablespoons butter into small pieces, add it to the pan, and stir until melted. Spoon the amaranth onto plates or into soup bowls and top with the mushroom mixture.	0
