, until browned, 1015 minutes; transfer to a plate.\nCook lemongrass paste in same pot, stirring often, until lemongrass is beginning to soften, 58 minutes. Add star anise, cinnamon, soy sauce, fish sauce, brown sugar, beef with any juices, and 10 cups water. Bring to a boil, reduce heat, and simmer, partially covered, skimming occasionallly, until beef is tender and liquid is slightly thickened, 2 1/23 hours.\nMeanwhile, preheat oven to 350F. Toast coconut flakes on a rimmed baking sheet, tossing occasionally, until golden around the edges, about 4 minutes; set aside.\nAdd shallots and carrots to stew and cook, partially covered, until vegetables are soft and beef is falling apart, 3545 minutes. Mix in scallions (they should wilt slightly).\nMeanwhile, cook noodles according to package directions.\nDivide noodles among bowls and ladle stew over; top with toasted coconut and more scallions. Serve with lime wedges.\nDO AHEAD: Stew (without noodles) can be made 3 days ahead. Let cool; cover and chill.	0
