fer chops to a plate and continue to roast potatoes until tender; transfer chops back to skillet when potatoes are done.) Remove skillet from oven and mix in parsley and vinegar. Let pork chops rest 5 minutes in skillet.\nTransfer chops to a cutting board; cut meat from bones and slice against the grain. Serve with potatoes, shallots, and any pan juices.\nDO AHEAD: Pork chops can be marinated 1 day ahead. Keep chilled.	0
