n with salt and pepper.\nDivide walnut mixture among plates and top with endive salad.\nDO AHEAD: Vinaigrette can be made 1 day ahead; cover and chill. Walnuts and breadcrumbs can be toasted 1 day ahead; store airtight at room temperature.	0
