s not practical, warm the bowl just before use with hot water, even a ladleful of the pasta cooking water.\nDrain the pasta and put it in the warmed serving bowl. Toss it first with the grated cheese, then with the sauce. Serve immediately.	0
clxyfmswr03kzzq1dkdavb61p	clxyfmnwh01uozq1drw8tm32q	Thin Mints Girl Scout Cookie Cheesecake	2024-06-28 08:29:31.227	 ['1 (9-ounce) box Thin Mints Girl Scout cookies\n coarsely chopped'\n '7 tablespoons unsalted butter\n melted'\n '12 ounces bittersweet (not unsweetened) or semisweet chocolate\n coarsely chopped'\n '2 pounds cream cheese\n room temperature'\n '1 3/4 cups sugar'\n '4 large eggs'\n '1/4 cup heavy cream'\n '1/2 cup unsweetened cocoa powder\n sifted'\n '1 tablespoon pure vanilla extract'\n '1 teaspoon peppermint extract'\n 'Equipment: food processor; 9-inch-diameter springform pan with 2 3/4-inch-high sides; stand mixer fitted with the paddle attachment']	Ingredients:\n ['1 (9-ounce) box Thin Mints Girl Scout cookies\n coarsely chopped'\n '7 tablespoons unsalted butter\n melted'\n '12 ounces bittersweet (not unsweetened) or semisweet chocolate\n coarsely chopped'\n '2 pounds cream cheese\n room temperature'\n '1 3/4 cups sugar'\n '4 large eggs'\n '1/4 cup heavy cream'\n '1/2 cup unsweetened cocoa powder\n sifted'\n '1 tablespoon pure vanilla extract'\n '1 teaspoon peppermint extract'\n 'Equipment: food processor; 9-inch-diameter springform pan with 2 3/4-inch-high sides; stand mixer fitted with the paddle attachment']\nRecipe:\nIn the bowl of a food processor, finely grind the cookies. Add the melted butter and process until the crumbs start to stick together. Press the crumb mixture firmly into the bottom and up the sides of a 9-inch-diameter springform pan with 2 3/4-inch-high sides. Chill until ready to use.\nPosition a rack in the center of the oven and preheat to 350F.\nIn a dry metal bowl set over a pan of barely simmering water, melt the chocolate, stirring until smooth. Let cool until lukewarm.\nIn a stand mixer fitted with the paddle attachment, beat the cream cheese and sugar until blended. Add the eggs, one at a time, beating until just incorporated. Add the melted chocolate, along with the heavy cream, cocoa powder, and the vanilla and peppermint extracts and beat, scraping down the bowl and paddle as necessary, until smooth and streak-free.\nPour the filling into the prepared crust, smooth the top, and bake until the center is just set, about 1 hour. Transfer to a rack to let cool for 20 minutes. Press down gently on the puffed edges to flatten then run a small sharp knife around the top edge of the pan to loosen the cake. Do not remove the pan sides. Let cool completely then cover with a double layer of plastic wrap and chill overnight. Bring to room temperature before serving, if desired. DO AHEAD: The cheesecake can be baked ahead, cooled, wrapped in a double layer of plastic wrap, and refrigerated for up to 3 days.	0
clxyfmrm6035fzq1d5jpjbp00	clxyfmkve01dbzq1dm07s0n2y	Cinnamon Apple Scones	2024-06-28 08:29:29.55	 ['3 cups blanched almond flour'\n '1 1/2 teaspoons baking soda'\n '1/2 teaspoon fine sea salt'\n '4 tablespoons butter\n as cold as possible (preferably frozen)\n cut into small pieces'\n '1 teaspoon ground cinnamon'\n '2 large eggs'\n '2 tablespoons apple cider vinegar'\n '2 tablespoons honey'\n '1 small Granny Smith or Fuji apple\n peeled\n cored\n and cut into thin tiles']	Ingredients:\n ['3 cups blanched almond flour'\n '1 1/2 teaspoons baking soda'\n '1/2 teaspoon fine sea salt'\n '4 tablespoons butter\n as cold as possible (preferably frozen)\n cut into small pieces'\n '1 teaspoon ground cinnamon'\n '2 large eggs'\n '2 tablespoons apple cider vinegar'\n '2 tablespoons honey'\n '1 small Granny Smith or Fuji apple\n peeled\n cored\n and cut into thin tiles']\nRecipe:\n1. Preheat the oven to 350F with the rack in the middle position, and line a rimmed baking sheet with parchment paper.\n2. In a large bowl, combine the almond flour, baking soda, and fine sea salt. Use your hands or a pastry cutter to work the pieces of cold butter into the dry ingredients until a crumbly mixture is produced. Then, mix the cinnamon into the almond flour mixture.\n3. In a separate bowl, thoroughly whisk together the eggs, apple cider vinegar, and honey.\n4. Make a well in the middle of the dry ingredients, and pour the egg mixture into it.\n5. Gently mix with a spatula until a wet, chunky dough forms, and then throw in the apple. Combine the ingredients with your hands, and form a ball of dough.\n6. On a sheet of parchment paper or a nonstick surface, gently flatten the ball with your hand. The round of dough should be about 3/4 inch thick. Using a pastry cutter or a sharp knife, cut the dough into 6 equal-sized wedges, and arrange them on the parchment-lined baking sheet.\n7. Bake for 20 to 25 minutes, rotating the tray halfway through. The scones are ready when they're golden brown, and an inserted toothpick comes out clean. Transfer the scones onto a wire rack to cool slightly before serving.\nThis isn't just another subpar substitute for the real thing. It's BETTER than scones made with wheat flour!\nIn the mood for Dark Chocolate Cherry Scones instead? Follow the same recipe, but leave out the cinnamon and apple. Add 1 teaspoon of vanilla extract in step 3. Then, in step 5, add 3 ounces of super dark chocolate, cut into bite-size chunks, and 1/4 cup of dried cherries.	0
