 Using the overhanging plastic wrap that lines the pan, carefully lift the cake from the pan and place it on a large plate or serving platter. Place a second large plate on top of the cake then invert the cake, remove the first plate, and peel off the plastic wrap. Place the original large plate or platter on top of the cake and invert it a final time so that the cookie crust is on the bottom. Using 2 small spoons, drizzle the chocolate and caramel sauces over the ice cream cake. Serve immediately.	0
