emaining 1 teaspoon canola oil. Add the cauliflower florets, season to taste with salt and pepper, and saut until heated through, about 5 minutes. Add enough Buffalo sauce to coat the cauliflower and continue sauting until both the cauliflower and the sauce are hot, about 5 minutes. Transfer the cauliflower to a platter and garnish with the crumbled blue cheese.	0
