 pan to a wire rack and let cake cool completely in pan before turning out.\nHeat chocolate, butter, and salt in a heatproof bowl set over a saucepan of simmering water (bowl should not touch water), stirring, until chocolate and butter are melted, about 5 minutes. Whisk in powdered sugar.\nMeanwhile, bring wine just to a boil in a small saucepan.\nRemove chocolate mixture from heat and whisk in wine; let cool until slightly thickened and a rubber spatula leaves a trail in mixture when stirring, 810 minutes.\nSet cake on a wire rack set over a rimmed baking sheet. Pour glaze over cake and spread it across the top and over the edges with an offset spatula. Let cake stand at room temperature until glaze is set, 23 hours.\nDO AHEAD: Cake can be made and glazed 2 days ahead. Chill. Bring to room temperature before serving.	0
