m the heat.\n3. Fill a medium bowl with warm water. Dip one of the wrappers in the water for 15 seconds, or until softened. Carefully transfer to a dry work surface.\n4. Arrange 2 to 3 tablespoons of the filling in an even horizontal mound just below the center of the wrapper. Roll up the rice paper to form a tight cylinder, folding in the sides about halfway. Assemble the remaining spring rolls in the same manner. Cover the finished rolls with a damp cloth to prevent them from drying out.\n5. Preheat the broiler. Lightly coat a large nonstick baking sheet with cooking spray. Arrange the spring rolls in a single layer on the baking sheet, leaving a little space between them. Lightly coat the rolls with cooking spray.\n6. Broil the rolls until lightly browned and crisp, 10 to 13 minutes. Using tongs or a spatula, turn the rolls over and continue to broil for another 8 to 10 minutes.\n7. Serve each roll wrapped in a lettuce leaf garnished with nuts, and accompanied by the Lime-Soy-Ginger Sauce.	0
clxyfmrz803ahzq1dhw7m7lxr	clxyfmlp901i6zq1dko4zcovt	Macaroni and Cheese	2024-06-28 08:29:30.02	 ['6 tablespoons unsalted butter\n plus more to grease the baking dish'\n '1 cup panko bread crumbs'\n '24 ounces sharp or extra-sharp Cheddar\n grated (about 9 cups total)'\n '1 pound elbow macaroni'\n '3 1/4 cups whole milk'\n '3 tablespoons all-purpose flour'\n '1 1/2 teaspoons dry mustard'\n '1 teaspoon fine sea salt'\n '1/2 teaspoon freshly ground black pepper'\n 'Equipment: 9- by 13-inch baking dish\n flat-edged wooden spoon or heat-safe rubber spatula']	Ingredients:\n ['6 tablespoons unsalted butter\n plus more to grease the baking dish'\n '1 cup panko bread crumbs'\n '24 ounces sharp or extra-sharp Cheddar\n grated (about 9 cups total)'\n '1 pound elbow macaroni'\n '3 1/4 cups whole milk'\n '3 tablespoons all-purpose flour'\n '1 1/2 teaspoons dry mustard'\n '1 teaspoon fine sea salt'\n '1/2 teaspoon freshly ground black pepper'\n 'Equipment: 9- by 13-inch baking dish\n flat-edged wooden spoon or heat-safe rubber spatula']\nRecipe:\nPreheat the oven to 350F. Lightly butter a 9- by 13-inch baking dish.\nIn a small saucepan over moderate heat, melt 3 tablespoons of the butter. Place the panko bread crumbs in a small bowl, drizzle with the melted butter, and toss to combine. Add a handful of the grated cheese to the bowl, toss to combine, and set aside.\nIn a large pot of boiling salted water, cook the elbow macaroni until al dente. Drain the noodles, without rinsing, then return them to the pot they were cooked in.\nIn a small saucepan over moderate heat, warm the milk just until it starts to steam and form tiny bubbles around its edgesbe careful not to let the milk come to a boil. Remove from the heat.\nIn a medium saucepan over moderate heat, melt the remaining 3 tablespoons of butter. Add the flour and use a flat-edged wooden spoon or heat-safe rubber spatula to stir the mixture together, scraping the bottom of the pan to prevent burning, just until it starts to turn a light brown color, about 3 minutes. Slowly add the warm milk and stir constantly until the sauce thickens, about 3 minutes. Remove from the heat and stir in the dry mustard, salt, and pepper. Add the remaining grated cheese and stir until it's completely melted. Adjust the seasoning to taste. Pour the cheese sauce over the cooked elbow macaroni and gently stir to coat the noodles in the sauce.\nPour the macaroni and cheese into the prepared baking dish and top with the panko-cheese mixture. Bake until light golden brown and bubbling, about 30 minutes. Serve hot. DO AHEAD: Macaroni and cheese can be made ahead, put into the baking dish, cooled completely, and kept, covered in the refrigerator, for 2 days. Do not add the bread crumbs until ready to bake. (Chilled Macaroni and Cheese may take longer than 30 minutes to be fully cooked.)	0
