tes more. Cool 10 minutes before serving.	0
clxyfmsab03erzq1daabdvi77	clxyfmmpw01nqzq1dn4lnucdj	Angry Shrim8p	2024-06-28 08:29:30.42	 ['2 tablespoons pumpkin seeds'\n '1/2 cup golden raisins'\n '2 tablespoons olive oil\n divided'\n '3/4 cup diced white onion'\n '1/4 cup dried cherries\n chopped'\n '2 teaspoons chipotle powder'\n '4 teaspoons chopped garlic\n divided'\n '1/2 teaspoons ground cumin'\n '1/2 cup Grand Marnier orange liqueur'\n '20 ounces low-sodium vegetable broth'\n '1 tablespoon cornstarch'\n '2 pounds medium-large shrimp\n peeled and deveined\n thawed if frozen'\n '1 tablespoon orange zest'\n '6 cups kale\n stems removed\n chopped'\n '3 cups cooked brown rice']	Ingredients:\n ['2 tablespoons pumpkin seeds'\n '1/2 cup golden raisins'\n '2 tablespoons olive oil\n divided'\n '3/4 cup diced white onion'\n '1/4 cup dried cherries\n chopped'\n '2 teaspoons chipotle powder'\n '4 teaspoons chopped garlic\n divided'\n '1/2 teaspoons ground cumin'\n '1/2 cup Grand Marnier orange liqueur'\n '20 ounces low-sodium vegetable broth'\n '1 tablespoon cornstarch'\n '2 pounds medium-large shrimp\n peeled and deveined\n thawed if frozen'\n '1 tablespoon orange zest'\n '6 cups kale\n stems removed\n chopped'\n '3 cups cooked brown rice']\nRecipe:\nIn a small pan over high heat, toast pumpkin seeds, stirring constantly, until lightly brown, 1 to 2 minutes. In a food processor, puree raisins and 1/4 cup water 1 minute. In a large pan over medium heat, heat 1 tablespoon oil. Add onion; cook until translucent, 5 minutes. Stir in raisin puree, cherries, chipotle, 1 teaspoons garlic and cumin; cook 1 minute. Add Grand Marnier and cook, stirring, until alcohol is cooked out, 1 to 2 minutes. Add broth and bring to a boil, then reduce heat and simmer. In a bowl, dissolve cornstarch in 1 tablespoons cold water. Gradually add cornstarch mixture to broth mixture to thicken; reduce heat and simmer 7 to 10 minutes. Add shrimp; cook until pale white, 5 minutes. Stir in zest; season with salt and pepper. Transfer to a bowl and set aside. In pan, heat remaining 1 tablespoons oil. Cook kale and 3 teaspoons garlic, stirring, until kale starts to wilt, 3 to 5 minutes. Strain juices and combine with rice. Divide rice mixture, shrimp and seeds among 6 plates.	0
clxyfmsmk03i9zq1dog09t5gt	clxyfmnjr01slzq1dcwu1g5im	Carbonara (Guanciale, Egg, and Pecorino Romano)	2024-06-28 08:29:30.86	 ['4 ounces (115 grams) guanciale\n cut into 1/4-inch (1/2-centimeter) dice'\n '2 generous tablespoons extra virgin olive oil\n preferably lightly fruity'\n '3 large eggs\n at room temperature'\n '10 rounded tablespoons (100 grams) freshly grated pecorino romano\n or half pecorino romano and half parmigiano-reggiano'\n 'freshly ground black pepper'\n '1 pound (450 grams) pasta (see note below)']	Ingredients:\n ['4 ounces (115 grams) guanciale\n cut into 1/4-inch (1/2-centimeter) dice'\n '2 generous tablespoons extra virgin olive oil\n preferably lightly fruity'\n '3 large eggs\n at room temperature'\n '10 rounded tablespoons (100 grams) freshly grated pecorino romano\n or half pecorino romano and half parmigiano-reggiano'\n 'freshly ground black pepper'\n '1 pound (450 grams) pasta (see note below)']\nRecipe:\nPut the guanciale and oil in a large skillet. Saut over medium heat until the edges of the guanciale pieces are just turning brown, about 2 minutes. Don't let it get too crisp. Set the pan and its contents aside but keep warm.\nBring 5 quarts (5 liters) of water to a boil in an 8-quart (8-liter) pot over high heat. When the water boils, add 3 tablespoons kosher salt, then add the pasta and cook, stirring occasionally, until al dente.\nWhile the pasta is cooking, break the eggs into a small bowl and add all the cheese and a generous grinding of pepper. Whisk gently until the mixture is smooth.\nDrain the pasta (reserving and keeping warm a cup of its water) and put it in the skillet with the guanciale over low heat. Toss quickly to mix well.\nHolding the skillet slightly above but not touching the burner, pour the egg and cheese mixture in a stream into the pasta. Now, if you have the skill, toss the pasta with a deft movement of the wrist to blend all the contents of the pan. If you don't, remove the pan from the heat and mix quickly with two wooden spoons. If you have a warm spot, such as a food warmer or even over a pilot light, rest the pan there while you work.\nWhatever you do, work fast or the pasta will get cold and the eggs will stay raw and runny. Ideally the heat of the pasta will cook the egg just enough, and the sauce should be creamy. You can mix in a tiny bit of the reserved water to smooth things out, but you probably won't need to.\nTransfer to individual heated bowls or plates and serve instantaneously.	0
clxyfmsnn03inzq1diaj6yp4q	clxyfmnjr01slzq1dcwu1g5im	Pasta All'uovo (Egg Dough)	2024-06-28 08:29:30.899	 ['1 pound (450 grams) sifted all-purpose flour (farina 00)'\n '5 medium or large eggs\n or 4 extra-large or jumbo'\n 'Extra flour for dusting and adjusting']	Ingredients:\n ['1 pound (450 grams) sifted all-purpose flour (farina 00)'\n '5 medium or large eggs\n or 4 extra-large or jumbo'\n 'Extra flour for dusting and adjusting']\nRecipe:\nSift the flour onto a large wooden board. Form the flour into a mound with the approximate profile of Mount Fuji. Form your hand into a loose fist, and, with the back of the fingers, gently ream out the center of the mound until you have something that resembles a low, broad volcano with a very deep crater. Italian cooks call this a fountain, fontana, for the pool of liquid in the center, but it's definitely a cone.\nBreak all the eggs into the crater one by one. Pierce the yolks with a fork and begin gingerly to use the fork to incorporate them into the flour with a movement something like scrambling eggs. Incorporate the liquid from the center outward. The walls of the crater will keep the liquid from running out.\nWhen the liquid has absorbed enough flour that you now have a messy, wet dough surrounded by flour, knock what's left of the volcano in toward the center and begin to knead with your hands to incorporate the rest of the flour into the dough. Scrape up all the remaining flour and the dough bits and squeeze them into the dough.\nPut all the ingredients in the container of a food processor fitted with the steel blade (not pastry hooks or the like). Let rip at high speed until you see crumbs forming. Keep going until the dough forms a ball. You may become convinced that your dough will never form a single ball, only many little ones. In that case, give up because you risk overheating the dough. Pour what you have out on the wooden board; use your hands to form the pieces into a single loaf of dough.\nThe biggest mistake people make, says Oretta, is not using enough force. Skip the gym the day you make pasta and make kneading your workout. The women of Scandriglia, where Oretta has her country house, recommend making fettuccine as a remedy for backache in preference to those boring exercises. On the other hand, my friend Antonietta, who learned to make pasta as a child in Basilicata, tells me southern men enjoy watching the undulating hips of southern women as they knead the pasta dough. If it helps to put on some music and do the maccheroni mambo as you knead, go right ahead.\nPlant your feet firmly on the floor and the heels of your hands firmly on the dough in front of you. A dining table will usually be a more comfortable height than a kitchen counter, which may be too high. With all your strength, and leaning in with your whole body, push the dough forward hard with the heel of one hand, then with the heel of the other hand. Then fold it over and continue the movement, alternating handsor whatever works for you. You're pushing the whole piece of dough forward, so it moves on the board.\nAfter each completed movement, give the dough a quarter turn and repeat. Keep this up for 30 minutes, or as long as you can stand. If you've used the food processor, 15 or 20 minutes will do. You can quit early, too, if you plan to use a rolling machine: send the dough through one extra pass for each minute of kneading saved.\nAs you work, the dough may seem dry, but you don't want it to be wet and sticky. It needs just enough moisture to hold it together, not a drop more. If your dough is so dry that you are quite sure it will never hold together, you can add a teensy bit of water. (It used to be quite normal to use water to save eggs, which could be sold for cash.) Your goal is a single smooth loaf of dough that is not sticky to the touch. If the flour is either very freshly ground (hence moister) or very old (drier), you'll have to adjust by feel. When it feels just rightmoist but not tacky, considerably drier than the average dog's noseset it aside for a moment.\nYou'll probably need to clean the board about halfway through the process. Use a plastic scraper or the blunt side of a large knife to scrape up any bits that have stuck to the board. (Sharp knives may damage your nice wooden board, and their edges are dulled by scraping.) Likewise wash your hands, which are doubtless also encrusted with bits of dried dough by this time.\nOnce you have a beautifully silky loaf of dough, let it rest for 30 minutes to let the gluten develop. Wrap it in foil, or just place it on the board and invert a bowl over it until you're ready. By this time, you probably need to put your feet up too.\nWhen the dough and you have rested, you can proceed to the next stage. Depending on what kind of pasta you want to make, this may involve rolling and cutting to make a pasta sheet (sfoglia) or pulling pieces directly from the loaf of dough and shaping them by hand.	0
clxyfms1h03b9zq1dlccqglua	clxyfmltk01ivzq1d7flvm3yv	Glazed ChocolateCrme Frache Cookies	2024-06-28 08:29:30.101	 ['20 ounces bittersweet chocolate (at least 70% cacao)\n chopped\n divided'\n '1/4 cup all-purpose flour'\n '1 1/2 teaspoons baking powder'\n '1 teaspoon kosher salt'\n '1 1/2 cups (packed) brown sugar'\n '1/2 cup (1 stick) unsalted butter\n room temperature'\n '4 large eggs'\n '2 tablespoons crme frache or sour cream']	Ingredients:\n ['20 ounces bittersweet chocolate (at least 70% cacao)\n chopped\n divided'\n '1/4 cup all-purpose flour'\n '1 1/2 teaspoons baking powder'\n '1 teaspoon kosher salt'\n '1 1/2 cups (packed) brown sugar'\n '1/2 cup (1 stick) unsalted butter\n room temperature'\n '4 large eggs'\n '2 tablespoons crme frache or sour cream']\nRecipe:\nPlace racks in lower and upper thirds of oven; preheat to 350F. Heat 8 ounces chocolate in a heatproof bowl set over a saucepan of simmering water (bowl should not touch water), stirring until chocolate is melted; let cool slightly. Reserve saucepan for melting more chocolate for glaze.\nWhisk flour, baking powder, and salt in a small bowl; set aside. Using an electric mixer on medium-high speed, beat brown sugar and butter until light and fluffy, about 4 minutes. Add eggs and crme frache and beat until just combined. Reduce speed to low and gradually mix in melted chocolate; reserve chocolate bowl. Mix in dry ingredients just to combine; fold in 8 ounces chopped chocolate. Cover and chill dough until firm, at least 30 minutes.\nDrop heaping tablespoonfuls of dough onto parchment-lined baking sheets, spacing 2" apart. Bake cookies, rotating sheets halfway through, until edges are set but centers are still slightly soft, 1518 minutes. Let cookies cool on baking sheets 5 minutes. Transfer to wire racks and let cool.\nMelt remaining 4 ounces chocolate in reserved bowl set over reserved saucepan of simmering water. Let chocolate cool slightly, then dip or drizzle cookies with chocolate as desired. Let sit until chocolate is set, 1520 minutes.\nDO AHEAD: Cookies can be made 2 days ahead; store airtight at room temperature.	0
