(the shrimp will clump, but that is OK), until firm and crumbly, 7 to 8 minutes. Remove from the heat and use the meat grinder fitted with a fine (3/16-inch) die to grind the shrimp 2 more times.\nReturn the shrimp "grits" to the large, deep saut pan, and add the vegetable stock, corn powder, and remaining 4 tablespoons butter. Place over moderate heat and cook, stirring occasionally, until slightly thickened and hot, 2 to 3 minutes. Stir in the remaining 1/2 teaspoon salt, along with the scallion and pepper. Divide the shrimp "grits" evenly among 4 shallow bowls, garnish with pickled jalapeo slices, and, if desired, top each with 1 fried egg.	0
