up Parmesan and yogurt; simmer 3 to 5 minutes more. Remove skillet from heat; slowly add cornstarch mixture until sauce is thick enough to coat the back of a spoon. On a platter, combine pasta, sauce, chicken, vegetables, artichokes, remaining 1/4 cup Parmesan, parsley, and salt and pepper.	0
clxyfmsf503fxzq1drdpll518	clxyfmn3001ptzq1d5mx4lajj	Challah	2024-06-28 08:29:30.592	 ['2 1/2 cups whole milk or water'\n '8 2/3 cups all-purpose flour\n plus flour for the work surface'\n '1 1/2 tablespoons active dry yeast'\n '1/2 cup honey or sugar'\n '1/4 cup canola oil\n plus more oil for the bowl'\n '4 large eggs'\n '1 1/2 tablespoons kosher salt'\n 'White sesame or nigella seeds for sprinkling']	Ingredients:\n ['2 1/2 cups whole milk or water'\n '8 2/3 cups all-purpose flour\n plus flour for the work surface'\n '1 1/2 tablespoons active dry yeast'\n '1/2 cup honey or sugar'\n '1/4 cup canola oil\n plus more oil for the bowl'\n '4 large eggs'\n '1 1/2 tablespoons kosher salt'\n 'White sesame or nigella seeds for sprinkling']\nRecipe:\n1. Heat the milk in a small saucepan over low heat just until it's warm to the touch. Remove from the heat.\n2. Dump the flour into a large bowl and make a well in the center. Add the yeast to the well along with a few drops of honey and 1/2 cup or so of the warm milk. Let stand until foamy, about 10 minutes.\n3. In a separate bowl, combine the remaining milk and honey, the oil, and 3 of the eggs. Stir together. Add the salt and stir again. Gradually stir the liquid mixture into the flour, about 1/2 cup at a time. When the dough becomes sticky and difficult to stir, dump onto a floured surface and knead it by hand, adding a little more flour if necessary to keep it from sticking, until smooth and elastic.\n4. Knead the dough into a ball. Slick another large bowl with oil, add the dough, and turn to slick the surface with oil. Cover with a damp cloth and let stand in a warm place until double in size, 1 to 1 1/2 hours.\n5. Line 2 baking sheets with parchment paper. Gently punch the dough down and turn it onto a floured surface. Divide the dough into four equal portions, working with one portion at a time and keeping the rest covered with a damp cloth. Divide one portion of dough into three equal pieces and roll each piece into a rope about 1 foot long and slightly tapered at the ends. Line the ropes side by side on one side of the baking sheet and braid them, pinching the ends to seal and tucking them underneath. Repeat this process with the remaining dough until you have four nicely braided loaves. Cover with a damp cloth and let stand until nearly double in size, another 25 minutes or so.\n6. Preheat the oven to 350F.\n7. Lightly beat the remaining egg and brush it over the tops of the challah loaves. Sprinkle with the nigella or sesame seeds. Bake the loaves until golden brown, 20 to 30 minutes.	0
clxyfmskd03hhzq1dkvtxizm8	clxyfmnfj01rwzq1du0c3617f	Easy Cheesy Meatballs	2024-06-28 08:29:30.781	 ['3 tablespoons Italian-seasoned tomato paste'\n '3 tablespoons full-bodied red wine\n such as a California Zinfandel'\n '2 teaspoons Red wine vinegar'\n '1 1/4 pounds lean ground beef\n preferably 93% lean'\n '3 ounces (about 3/4 cup) provolone cheese\n finely shredded'\n '1/3 cup uncooked long-grain white rice'\n '1 teaspoon dried oregano'\n '3/4 teaspoon dried thyme'\n '1/2 teaspoon crushed fennel seeds']	Ingredients:\n ['3 tablespoons Italian-seasoned tomato paste'\n '3 tablespoons full-bodied red wine\n such as a California Zinfandel'\n '2 teaspoons Red wine vinegar'\n '1 1/4 pounds lean ground beef\n preferably 93% lean'\n '3 ounces (about 3/4 cup) provolone cheese\n finely shredded'\n '1/3 cup uncooked long-grain white rice'\n '1 teaspoon dried oregano'\n '3/4 teaspoon dried thyme'\n '1/2 teaspoon crushed fennel seeds']\nRecipe:\n1 Whisk the tomato paste, wine, and vinegar in a shallow bowl.\n2 Mix the ground beef, cheese, rice, oregano, thyme, and fennel seeds in a large bowl until the cheese and seasonings are evenly distributed throughout the ground beef.\n3 Form the mixture into balls, using about 1/3 cup for each fairly large meatball. As the meatballs are made, roll them in the tomato paste mixture, coating them lightly and evenly, then set them in the slow cooker in a single layer.\n4 Once all the meatballs are made, cover the cooker and cook on low for 6 hours, or until the meatballs are firm and cooked through.	0
clxyfmt0503m5zq1dhwu0b91j	clxyfmo5k01w2zq1dimz41nqr	Red Curry of Lobster and Pineapple	2024-06-28 08:29:31.349	 ['One 14-ounce can unsweetened coconut milk'\n '2 tablespoons red curry paste'\n '1 1/2 tablespoons fish sauce (nam pla)'\n '1 (packed) tablespoon grated palm sugar (jaggery) or light brown sugar'\n '8 ounces Chinese long beans or green beans\n ends trimmed'\n '4 slices peeled fresh ginger'\n '2 kaffir lime leaves or grated zest of 1 lime'\n '1 1/2 teaspoons tamarind paste'\n '1 1/2 cups bite-size cubes peeled fresh pineapple (about 1/4 of a pineapple)'\n 'Two 8-ounce uncooked lobster tails in the shell\n split lengthwise'\n '1/2 cup fresh basil leaves'\n 'Salt'\n 'Hot steamed rice\n for serving']	Ingredients:\n ['One 14-ounce can unsweetened coconut milk'\n '2 tablespoons red curry paste'\n '1 1/2 tablespoons fish sauce (nam pla)'\n '1 (packed) tablespoon grated palm sugar (jaggery) or light brown sugar'\n '8 ounces Chinese long beans or green beans\n ends trimmed'\n '4 slices peeled fresh ginger'\n '2 kaffir lime leaves or grated zest of 1 lime'\n '1 1/2 teaspoons tamarind paste'\n '1 1/2 cups bite-size cubes peeled fresh pineapple (about 1/4 of a pineapple)'\n 'Two 8-ounce uncooked lobster tails in the shell\n split lengthwise'\n '1/2 cup fresh basil leaves'\n 'Salt'\n 'Hot steamed rice\n for serving']\nRecipe:\nSimmer 1/4 cup of the coconut milk in a heavy large saucepan over medium heat for 5 minutes, or until the oil separates from the milk. Stir in the curry paste and cook for 1 minute. Add the fish sauce and sugar and cook for 2 minutes, stirring constantly, or until the mixture darkens and thickens. Add the green beans and stir to coat. Add the remaining coconut milk and stir to scrape up the browned bits on the bottom of the pan. Stir in the ginger, lime leaves, and tamarind paste. Add the pineapple and simmer for 3 minutes, stirring occasionally, or until the sauce reduces and thickens slightly and the beans are crisp-tender. Add the lobster and basil leaves and cook for 4 minutes, or until the lobster is just cooked through.\nDiscard the ginger and lime leaves. Season the curry with salt to taste. Transfer one half lobster tail to each warmed serving bowl, and spoon the curry over it. Serve the steamed rice on the side.	0
