clxyfmsj203h3zq1dw07ykuoe	clxyfmnbl01r7zq1dq749lyvp	Fudgy Brownie Cake	2024-06-28 08:29:30.734	 ['8 tablespoons (1 stick) unsalted butter\n cut into small bits\n plus more for greasing the canister'\n '9 ounces dark chocolate\n chopped'\n '2 ounces unsweetened chocolate\n chopped'\n '1 cup sugar'\n '2 large eggs\n at room temperature'\n '2 teaspoons vanilla extract'\n '2/3 cup all-purpose flour\n plus more for coating the canister'\n '1/2 teaspoon salt']	Ingredients:\n ['8 tablespoons (1 stick) unsalted butter\n cut into small bits\n plus more for greasing the canister'\n '9 ounces dark chocolate\n chopped'\n '2 ounces unsweetened chocolate\n chopped'\n '1 cup sugar'\n '2 large eggs\n at room temperature'\n '2 teaspoons vanilla extract'\n '2/3 cup all-purpose flour\n plus more for coating the canister'\n '1/2 teaspoon salt']\nRecipe:\n1 Generously grease the inside of the slow cooker canister by holding a small slice of butter with a paper towel and rubbing the butter all over the surfaces. Add some flour, then turn the crock this way and that to coat both the bottom and the walls with a fine, even dusting. Tap out any excess flour.\n2 Set up a double boiler with about 1 inch of water in the bottom pan, simmering over medium heator place a large, heat-safe metal bowl over a medium saucepan with a similar amount of simmering water. Add the butter and both chocolates. Stir with a rubber spatula until about two-thirds of the chocolate has melted. Remove the top half of the double boiler or the bowl from the saucepan below, then continue stirring off the heat until all the chocolate has melted. Cool for 10 minutes.\n3 Meanwhile, beat the sugar, eggs, and vanilla in a large bowl with an electric mixer at medium speed until quite thick and pale yellow, up to 10 minutes.\n4 Beat in the cooled chocolate mixture until smooth, then scrape down and remove the beaters. Fold in the flour and salt with a rubber spatula, using wide, gentle arcs to make sure every speck of flour has been moistened. Pour and spread this mixture into the slow cooker.\n5 Lay long strips of paper towels across the top of the slow cooker, overlapping each other and hanging down the sides for stability. Set the lid in place, then cook on high for about 1 hour 20 minutes in a small (2- to 3 1/2-quart) slow cooker, about 1 hour 40 minutes in a medium (4- to 5 1/2-quart) one, or about 2 hours in a large (6- to 8-quart) model, or until the cake is firm to the touch and the edges are dry while the middle is dark and moist. Unplug, uncover, and cool in the canister for 30 minutes before cutting out slices with a nonstick-safe knife or setting a cutting board over the cooker, inverting it, and turning the cake out.	0
clxyfmslo03hvzq1dvxtmcr9g	clxyfmnfj01rwzq1du0c3617f	Trail Mix Porridge	2024-06-28 08:29:30.829	 ['6 cups water'\n '1 1/2 cups chopped fresh cranberries'\n '3/4 cup pearled barley'\n '3/4 cup packed light brown sugar'\n '1/2 cup walnut pieces\n toasted and coarsely ground'\n '6 tablespoons medium-ground bulgur (or #2)'\n '6 tablespoons corn (or hominy) grits'\n '6 tablespoons millet'\n '6 tablespoons maple syrup'\n '1/2 teaspoon ground cinnamon'\n '1/4 teaspoon salt']	Ingredients:\n ['6 cups water'\n '1 1/2 cups chopped fresh cranberries'\n '3/4 cup pearled barley'\n '3/4 cup packed light brown sugar'\n '1/2 cup walnut pieces\n toasted and coarsely ground'\n '6 tablespoons medium-ground bulgur (or #2)'\n '6 tablespoons corn (or hominy) grits'\n '6 tablespoons millet'\n '6 tablespoons maple syrup'\n '1/2 teaspoon ground cinnamon'\n '1/4 teaspoon salt']\nRecipe:\nStir all the ingredients in a slow cooker until the maple syrup has dissolved and all the grains are moistened. Cover and cook on low for 6 hours, or until the porridge is creamy and the grains are tender.	0
clxyfmt2s03nbzq1dw9yw3qwr	clxyfmo9q01wrzq1d9a2os2og	Easy Pad Thai	2024-06-28 08:29:31.444	 ['8 ounces pad thai or lo mein noodles'\n '2 tablespoons vegetable oil'\n '1 clove garlic\n minced'\n '2 large eggs'\n '1 1/2 tablespoons soy sauce'\n '2 tablespoons fresh lime juice (from about 1 medium lime)'\n '2 tablespoons brown sugar'\n '1 teaspoon fish sauce'\n '1/8 teaspoon red pepper flakes'\n '3 green onions\n sliced'\n '1/4 bunch fresh cilantro\n leaves only\n roughly chopped'\n '1/4 cup chopped\n unsalted peanuts']	Ingredients:\n ['8 ounces pad thai or lo mein noodles'\n '2 tablespoons vegetable oil'\n '1 clove garlic\n minced'\n '2 large eggs'\n '1 1/2 tablespoons soy sauce'\n '2 tablespoons fresh lime juice (from about 1 medium lime)'\n '2 tablespoons brown sugar'\n '1 teaspoon fish sauce'\n '1/8 teaspoon red pepper flakes'\n '3 green onions\n sliced'\n '1/4 bunch fresh cilantro\n leaves only\n roughly chopped'\n '1/4 cup chopped\n unsalted peanuts']\nRecipe:\nBring a large pot of water to a rolling boil. Add the noodles and cook for 7 to 10 minutes or until tender. Drain the noodles and set aside.\nIn a large skillet, heat the vegetable oil over medium heat. Add the garlic and cook for 1 to 2 minutes, or until tender.\nWhisk the eggs lightly with a fork. Pour them into the skillet and cook just until they solidify, but are still moist, moving the eggs around the skillet slightly as they cook so that they lightly scramble. When the eggs are cooked, remove the skillet from the heat and set aside.\nIn a small bowl, stir together the soy sauce, lime juice, sugar, fish sauce, and red pepper flakes. Pour the sauce into the skillet with the scrambled eggs. Add the noodles and toss to coat in the sauce.\nSprinkle the green onions, cilantro, and peanuts over the noodles. Toss lightly to combine. Serve warm.\nPad thai noodles have a unique flavor and texture, but if you can't find them in your area, try substituting another flat pasta like linguine.	0
