clxyfn7vf060bzq1doehzmno0	clxyfmtcm03odzq1dnqswjp5r	Toasted Coconut Sundaes with Candied Peanuts	2024-06-28 08:29:50.618	 ['1/2 cup unsweetened shredded coconut'\n '1/2 cup granulated sugar'\n '1 cup unsalted\n dry-roasted peanuts'\n '1/2 cup palm or light brown sugar'\n '2 cups heavy cream\n divided'\n '2 pints coconut ice cream or sorbet'\n '8 butter coconut cookies (for serving)'\n 'Ingredient info: Butter coconut cookies are available at many Asian markets.']	Ingredients:\n ['1/2 cup unsweetened shredded coconut'\n '1/2 cup granulated sugar'\n '1 cup unsalted\n dry-roasted peanuts'\n '1/2 cup palm or light brown sugar'\n '2 cups heavy cream\n divided'\n '2 pints coconut ice cream or sorbet'\n '8 butter coconut cookies (for serving)'\n 'Ingredient info: Butter coconut cookies are available at many Asian markets.']\nRecipe:\nPreheat oven to 350F. Toast coconut on a rimmed baking sheet, tossing once, until golden, about 5 minutes; let cool.\nMeanwhile, bring granulated sugar and 2 tablespoons water to a boil in a large skillet over medium-high heat, stirring to dissolve sugar. Cook, swirling pan occasionally and brushing down sides as needed with a wet brush, until mixture turns a deep amber color, 1012 minutes. Mix in peanuts; scrape onto a parchment-lined baking sheet. Let cool; chop.\nHeat palm sugar and 1/2 cup cream in a medium saucepan over medium heat, stirring to dissolve sugar. Transfer to a medium bowl; chill until cold. Add remaining 1 1/2 cups cream and beat to soft peaks. Divide ice cream among bowls and top with whipped cream, peanuts, and coconut. Serve with cookies.	0
clxyfmsz403lrzq1d6jeewbc2	clxyfmo1e01vdzq1dzpfq8m0u	Southwest Veggie and Rice Casserole	2024-06-28 08:29:31.311	 ['2 tablespoons vegetable oil'\n '1 medium onion\n diced'\n '2 cloves garlic\n minced'\n '1 medium jalapeo\n seeded and diced'\n '1 medium bell pepper\n seeded and diced'\n '1 medium zucchini\n quartered lengthwise and sliced'\n '1/2 tablespoon chili powder'\n '3/4 teaspoon salt'\n '1 cup frozen corn kernels'\n "1 (15-ounce) can diced tomatoes with chiles (see Chef's Tip\n below)"\n '1 (15-ounce) can black beans\n drained and rinsed'\n '3 cups Taco Rice'\n '2 cups shredded sharp cheddar'\n '2 green onions\n thinly sliced']	Ingredients:\n ['2 tablespoons vegetable oil'\n '1 medium onion\n diced'\n '2 cloves garlic\n minced'\n '1 medium jalapeo\n seeded and diced'\n '1 medium bell pepper\n seeded and diced'\n '1 medium zucchini\n quartered lengthwise and sliced'\n '1/2 tablespoon chili powder'\n '3/4 teaspoon salt'\n '1 cup frozen corn kernels'\n "1 (15-ounce) can diced tomatoes with chiles (see Chef's Tip\n below)"\n '1 (15-ounce) can black beans\n drained and rinsed'\n '3 cups Taco Rice'\n '2 cups shredded sharp cheddar'\n '2 green onions\n thinly sliced']\nRecipe:\nPreheat the oven to 375F. Coat an 8-by-8-inch casserole dish with nonstick cooking spray.\nIn a large skillet, heat the vegetable oil over medium-low heat. Add the onion and garlic and cook for about 5 minutes, or until the onions have softened. Add the jalapeo and bell peppers, zucchini, chili powder, and salt to the skillet and stir to combine. Raise the heat to medium and continue to saut until the vegetables are soft and no liquid remains on the bottom of the skillet, about 10 minutes.\nIn a large bowl, combine the corn kernels, diced tomatoes and chiles, and black beans. Add the sauted vegetables, Taco Rice, and shredded cheddar cheese to the bowl and stir until evenly mixed.\nPour the rice and vegetable mixture into the prepared casserole dish and bake for 20 minutes.\nSprinkle the green onions over the casserole and serve.	0
clxyfmtdi03p3zq1don8fllu1	clxyfmt8m03nozq1dw303m56a	Sashimi Salad with Soy and Orange	2024-06-28 08:29:31.83	 ['4 oranges'\n '1 or 2 limes'\n '1 tablespoon soy sauce'\n '3 tablespoons grapeseed oil'\n "6 cups mche (lamb's lettuce) leaves"\n '2 cups frise lettuce\n torn into bite-size pieces'\n '1/2 cucumber\n peeled\n seeded\n and thinly sliced (optional)'\n '7 ounces sushi-grade salmon\n skin removed'\n '1 teaspoon sesame seeds\n toasted']	Ingredients:\n ['4 oranges'\n '1 or 2 limes'\n '1 tablespoon soy sauce'\n '3 tablespoons grapeseed oil'\n "6 cups mche (lamb's lettuce) leaves"\n '2 cups frise lettuce\n torn into bite-size pieces'\n '1/2 cucumber\n peeled\n seeded\n and thinly sliced (optional)'\n '7 ounces sushi-grade salmon\n skin removed'\n '1 teaspoon sesame seeds\n toasted']\nRecipe:\nGrate the zest of 1 orange and the lime into a large bowl. Squeeze 1 tablespoon of juice from the grated orange and 2 tablespoons of juice from the grated lime into the bowl (you may need a second lime to get the 2 tablespoons of juice). Whisk in the soy sauce and the oil. Set the dressing aside.\nUse a sharp knife to slice the rind and pith from the remaining oranges. Working over a mixing bowl, cut between the membranes to free the orange segments, letting them drop into the bowl. Pour any juice into a cup and reserve it for another use. Add the mche, frise, and cucumbers, if using, to the orange segments. Using a large sharp knife, cut the salmon into 1/3-inch-thick slices. Add the salmon to the bowl. Drizzle with the dressing, and toss gently to coat. Allow the flavors to meld for at least 2 minutes.\nDivide the salad among 4 serving plates. Sprinkle with the toasted sesame seeds, and serve.	0
clxyfmttc03qtzq1d36812864	clxyfmt8m03nozq1dw303m56a	Flaky Bread	2024-06-28 08:29:32.4	 ['1 teaspoon kosher salt'\n '3 cups all-purpose flour\n plus more for surface'\n '6 tablespoons unsalted butter\n melted\n plus more\n room temperature\n for brushing (about 10 tablespoons)'\n 'Olive oil (for parchment)'\n 'Flaky sea salt (such as Maldon)']	Ingredients:\n ['1 teaspoon kosher salt'\n '3 cups all-purpose flour\n plus more for surface'\n '6 tablespoons unsalted butter\n melted\n plus more\n room temperature\n for brushing (about 10 tablespoons)'\n 'Olive oil (for parchment)'\n 'Flaky sea salt (such as Maldon)']\nRecipe:\nWhisk kosher salt and 3 cups flour in a large bowl. Drizzle in melted butter; mix well. Gradually mix in 3/4 cup water. Knead on a lightly floured surface until dough is shiny and very soft, about 5 minutes. Wrap in plastic; let rest in a warm spot at least 4 hours.\nDivide dough into 10 pieces and, using your palm, roll into balls. Place balls on a baking sheet, cover with plastic wrap, and let rest 15 minutes.\nRoll dough into thin rounds, brush with room-temperature butter, and roll up into ropes (see step-by-step instructions, below). Working with 1 coil at a time, roll out on an unfloured surface to 10" rounds no more than 1/8" thick. Stack as you go, separating with sheets of parchment brushed with oil.\nHeat a large cast-iron griddle or skillet over medium-high heat. Working 1 at a time, brush both sides of a dough round with room-temperature butter and cook until lightly blistered and cooked through, about 2 minutes per side. Transfer bread to a wire rack and sprinkle with sea salt.\nDO AHEAD: Coils can be rolled out 1 month ahead; wrap tightly and freeze. Cook from frozen (add 12 minutes to cooking time).	0
clxyfmt2003mxzq1dwhh82tos	clxyfmo9q01wrzq1d9a2os2og	Salted Caramel Pots de Crme	2024-06-28 08:29:31.416	 ['4 tablespoons (1/2 stick) unsalted butter'\n '3/4 cup packed light brown sugar'\n '1/2 teaspoon kosher salt'\n '1/2 vanilla bean\n split lengthwise'\n '1 3/4 cups heavy cream'\n '3/4 cup whole milk'\n '6 large egg yolks'\n 'Flake sea salt\n such as Maldon\n for garnish']	Ingredients:\n ['4 tablespoons (1/2 stick) unsalted butter'\n '3/4 cup packed light brown sugar'\n '1/2 teaspoon kosher salt'\n '1/2 vanilla bean\n split lengthwise'\n '1 3/4 cups heavy cream'\n '3/4 cup whole milk'\n '6 large egg yolks'\n 'Flake sea salt\n such as Maldon\n for garnish']\nRecipe:\n1. Position a rack in the center of the oven and preheat the oven to 325F. Place eight 1/2-cup (4-ounce) ovenproof cups, custard cups, or ramekins in a large baking pan.\n2. In a large heavy saucepan, melt the butter over medium heat. Whisk in the brown sugar and kosher salt. Using the tip of a small sharp knife, scrape the vanilla seeds from the bean, add to the butter mixture, and drop in the bean too. Stir for about 5 minutes, or until the mixture has the texture of thick sand and has taken on a nutty, caramel fragrance.\n3. Reduce the heat to medium-low and gradually whisk in the cream. The mixture will bubble vigorously and will seize when the cream is added. Whisk for about 5 minutes, or until the hardened sugar bits dissolve and the mixture begins to boil. Remove the pan from the heat and whisk in the milk.\n4. In a large bowl, stir the egg yolks to blend. Gradually whisk in the warm caramel mixture. Strain the custard through a fine-mesh sieve into a 4-cup liquid measuring cup or a bowl with a spout. Pour the custard into the cups, dividing it equally. Cover the pan with aluminum foil, leaving one corner uncovered. Place the pan in the oven and carefully pour enough hot water into the pan to come halfway up the sides of the cups, then cover the open corner with the foil. Bake the custards for about 50 minutes, or until they are just set around the edges but still jiggle slightly when the cups are gently shaken. (Be very careful of escaping steam when you uncover the pan.)\n5. Remove the cups from the pan and transfer to a wire rack to cool, about 1 hour. Cover each cup with plastic wrap and refrigerate until chilled, at least 4 hours, or up to 2 days.\n6. Sprinkle a pinch of sea salt over each pot de crme and serve chilled.\nThe pots de crme can be refrigerated for up to 2 days.	0
clxyfmwzi045lzq1d0fziszao	clxyfmt8m03nozq1dw303m56a	Classic Moonpies	2024-06-28 08:29:36.51	 ['Vegetable oil for brushing pan'\n "1/2 cup confectioners' sugar\n sifted\n plus more for dusting marshmallows"\n '3/4 cup cold water'\n '2 tablespoons powdered unflavored gelatin (from 2 to 3 envelopes)'\n '1 cup granulated sugar'\n '3/4 cup light corn syrup'\n '1/4 teaspoon kosher salt'\n '1 1/4 cups all-purpose flour'\n '1 1/4 cups whole-wheat pastry flour'\n '1/4 cup wheat germ'\n '1 teaspoons kosher salt'\n '1 teaspoon ground cinnamon'\n '1 teaspoon baking soda'\n '2 sticks (1/2 pound) unsalted butter at room temperature'\n '3/4 cup granulated sugar'\n "3 tablespoons Steen's cane syrup or dark molasses"\n '1 tablespoon honey'\n '1 pound semisweet chocolate\n finely chopped'\n 'Nonstick vegetable-oil spray'\n '2 tablespoons coconut oil\n at room temperature'\n 'Equipment: Pastry brush\n 15- by 10-inch jelly roll pan\n fine-mesh sieve\n stand mixer fitted with the whisk attachment and paddle\n candy thermometer\n small offset spatula\n 3-inch round cookie cutter\n 2 1/2- to 2 3/4-inch round cookie cutter\n parchment paper\n rolling pin\n 2 large rimmed baking sheets']	Ingredients:\n ['Vegetable oil for brushing pan'\n "1/2 cup confectioners' sugar\n sifted\n plus more for dusting marshmallows"\n '3/4 cup cold water'\n '2 tablespoons powdered unflavored gelatin (from 2 to 3 envelopes)'\n '1 cup granulated sugar'\n '3/4 cup light corn syrup'\n '1/4 teaspoon kosher salt'\n '1 1/4 cups all-purpose flour'\n '1 1/4 cups whole-wheat pastry flour'\n '1/4 cup wheat germ'\n '1 teaspoons kosher salt'\n '1 teaspoon ground cinnamon'\n '1 teaspoon baking soda'\n '2 sticks (1/2 pound) unsalted butter at room temperature'\n '3/4 cup granulated sugar'\n "3 tablespoons Steen's cane syrup or dark molasses"\n '1 tablespoon honey'\n '1 pound semisweet chocolate\n finely chopped'\n 'Nonstick vegetable-oil spray'\n '2 tablespoons coconut oil\n at room temperature'\n 'Equipment: Pastry brush\n 15- by 10-inch jelly roll pan\n fine-mesh sieve\n stand mixer fitted with the whisk attachment and paddle\n candy thermometer\n small offset spatula\n 3-inch round cookie cutter\n 2 1/2- to 2 3/4-inch round cookie cutter\n parchment paper\n rolling pin\n 2 large rimmed baking sheets']\nRecipe:\nBrush the bottom and sides of a 15- by 10-inch jelly roll pan with vegetable oil. Using a fine-mesh sieve, dust the bottom and sides of the pan with 1/4 cup of the sifted confectioners' sugar, leaving any excess in the pan.\nPlace 6 tablespoons of the cold water in the bowl of a stand mixer fitted with the whisk attachment. Sprinkle the gelatin into the bowl and whisk briefly to make sure all the gelatin is in contact with water. Let soften while you make the sugar syrup.\nIn a heavy, small saucepan, whisk together the granulated sugar, corn syrup, salt, and the remaining 6 tablespoons cold water. Place over moderate heat and bring to a full boil (the mixture will become clear), stirring until the sugar is dissolved. Put a candy thermometer into the boiling sugar syrup and continue boiling, without stirring, for 5 minutes, then increase the heat to moderately high and continue boiling, without stirring, until the thermometer registers 240F (soft-ball stage), about 5 more minutes. Remove the saucepan from the heat and let stand until the bubbles dissipate slightly.\nWith the mixer on low, pour the sugar syrup into the softened gelatin in a thin stream down the side of the bowl. Gradually increase the mixer speed to high and beat until the marshmallow forms a very thick ribbon when the whisk is lifted (the marshmallow will still be slightly warm), about 5 minutes.\nScrape the marshmallow into the prepared pan (it will be very sticky) and use wet fingertips to spread it evenly; smooth the top with a wet offset spatula. Dust the remaining 1/4 cup confectioners' sugar over the top of the marshmallows, then cover the pan with plastic wrap, being careful not to let the plastic wrap touch the marshmallow as they will stick together. Set the marshmallow aside to firm up, at least 4 hours or overnight.\nOnce the marshmallows are firm, use a 3-inch round cookie cutter to cut out 12 marshmallow circlesyou will need to cut the marshmallows very close together so there are very few scraps. Dust the marshmallows with additional confectioners' sugar to prevent sticking DO AHEAD: Marshmallows can be stored, layered between sheets of wax or parchment paper, in an airtight container in a dry place at cool room temperature, for 1 week.\nPosition a rack in the upper third of the oven and a second rack in the lower third then preheat to 350F.\nIn a medium bowl, whisk together the all-purpose flour, pastry flour, wheat germ, salt, cinnamon, and baking soda.\nIn the bowl of a stand mixer fitted with the paddle attachment, beat the butter and sugar on medium speed until light and fluffy, about 5 minutes. Add the cane syrup and honey and beat until well combined, about 1 minute. Scrape down the sides and bottom of the mixer bowl then reduce the mixer speed to medium-low, add the flour mixture, and blend just until no streaks of flour remain, 1 to 2 minutesthe mixture will be a little crumbly.\nDivide the dough into 2 equal portions. Place 1 half on a large sheet of parchment paper then cover with a second large piece of parchment paper. Using a rolling pin, roll the dough, between the sheets of parchment paper, to a 1/8-inch thickness. Remove the top layer of parchment and use a 2 1/2 to 2 3/4-inch round cookie cutter to press as many circles into the dough as possible. Use a small offset spatula to transfer the graham crackers to a large rimmed baking sheet, leaving about 1 inch between them then re-roll and cut any scraps of dough to make more circles. Repeat this process with the remaining portion of dough.\nBake the graham crackers, switching the baking pans between the upper and lower racks and rotating the pans about halfway through baking, until the graham crackers are firm around the edges and golden, 12 to 14 minutes. Transfer the graham crackers to a wire rack to let cool completely. DO AHEAD: Graham crackers can be baked ahead and kept, stored in an airtight container at room temperature, up to 1 week.\nSandwich 2 graham crackers around 1 marshmallow then repeat with the remaining graham crackers and marshmallows until you have 12 moon pie "sandwiches." (There may be a few leftover graham crackers.)\nCoat a wire rack with nonstick vegetable oil spray and set it on top of a parchment paper lined large rimmed baking sheet.\nPlace about 2/3 of the chocolate in a dry metal bowl set over a pan of barely simmering water and stir until melted and warm, 2 to 3 minutes. Add the remaining chocolate to the bowl and remove the bowl from the top of the pot. Let cool 5 minutes then stir until smooth. Stir in the coconut oil until incorporated thoroughly.\nHold 1 moonpie "sandwich" firmly in 1 hand and roll the sides through the melted chocolate, making sure the sides are completely coated so you don't see any marshmallow peeking through. Hold the moonpie over the bowl of chocolate and use a small spoon to pour and swirl chocolate over the top; invert onto the rack and coat the other side in chocolate. Repeat with the remaining graham crackermarshmallow "sandwiches." Transfer the chocolate-dipped moonpies to a cool place to let the chocolate coating harden for 1 to 2 hours. DO AHEAD: Moonpies can be made ahead and kept, layered between sheets of parchment paper in an airtight container at room temperature, up to 5 days.	0
clxyfmz6p04i1zq1ds9cot7o9	clxyfmt8m03nozq1dw303m56a	Green Mango Salad	2024-06-28 08:29:39.361	 ['2 Thai green or red chiles\n with seeds\n chopped'\n '1 garlic clove\n chopped'\n '1/2 cup (or more) fresh lime juice'\n '1/4 cup fish sauce'\n '2 tablespoons vegetable oil'\n '2 teaspoons palm or light brown sugar'\n '4 green mangoes or 1 green papaya\n julienned on a mandoline'\n '2 medium shallots\n thinly sliced'\n '1/2 cup unsalted\n dry-roasted peanuts\n coarsely chopped'\n '1/2 cup fresh cilantro leaves'\n '1/4 cup fresh mint leaves'\n '2 tablespoons toasted dried shrimp (optional)'\n '2 tablespoons toasted sesame seeds'\n 'Kosher salt']	Ingredients:\n ['2 Thai green or red chiles\n with seeds\n chopped'\n '1 garlic clove\n chopped'\n '1/2 cup (or more) fresh lime juice'\n '1/4 cup fish sauce'\n '2 tablespoons vegetable oil'\n '2 teaspoons palm or light brown sugar'\n '4 green mangoes or 1 green papaya\n julienned on a mandoline'\n '2 medium shallots\n thinly sliced'\n '1/2 cup unsalted\n dry-roasted peanuts\n coarsely chopped'\n '1/2 cup fresh cilantro leaves'\n '1/4 cup fresh mint leaves'\n '2 tablespoons toasted dried shrimp (optional)'\n '2 tablespoons toasted sesame seeds'\n 'Kosher salt']\nRecipe:\nPure chiles, garlic, lime juice, fish sauce, oil, and palm sugar in a blender until smooth.\nToss mangoes, shallots, peanuts, cilantro, mint, dried shrimp, if using, sesame seeds, and dressing in a large bowl; season with salt.\nDO AHEAD: Dressing can be made 1 day ahead. Cover and chill.	0
clxyfmzzb04mtzq1dddjh2qap	clxyfmtcm03odzq1dnqswjp5r	Spicy Honey-Glazed Parsnips	2024-06-28 08:29:40.391	 ['2 pounds parsnips\n peeled\n cut into 3" lengths\n halved\n or quartered if large'\n '1/4 cup olive oil'\n 'Kosher salt\n freshly ground pepper'\n '2 chiles de rbol\n crushed\n or 3/4 teaspoons crushed red pepper flakes'\n '2 tablespoons unsalted butter'\n '1 tablespoon apple cider vinegar'\n '1 tablespoon honey']	Ingredients:\n ['2 pounds parsnips\n peeled\n cut into 3" lengths\n halved\n or quartered if large'\n '1/4 cup olive oil'\n 'Kosher salt\n freshly ground pepper'\n '2 chiles de rbol\n crushed\n or 3/4 teaspoons crushed red pepper flakes'\n '2 tablespoons unsalted butter'\n '1 tablespoon apple cider vinegar'\n '1 tablespoon honey']\nRecipe:\nPreheat oven to 450F. Toss parsnips and oil on a rimmed baking sheet; season with salt and pepper. Roast parsnips, tossing occasionally, until tender and deep golden brown in spots, 3540 minutes.\nMeanwhile, heat chiles de rbol, butter, vinegar, and honey in a small saucepan over medium heat, stirring occasionally, until butter is melted.\nDrizzle chile-honey butter over parsnips and toss to coat.	0
clxyfn0ag04ovzq1dnywns35y	clxyfmtcm03odzq1dnqswjp5r	Calabrian Chile Oil	2024-06-28 08:29:40.792	 ['2 tablespoons finely chopped drained oil-packed Calabrian chiles'\n '1/2 cup olive oil'\n 'Kosher salt and freshly ground black pepper']	Ingredients:\n ['2 tablespoons finely chopped drained oil-packed Calabrian chiles'\n '1/2 cup olive oil'\n 'Kosher salt and freshly ground black pepper']\nRecipe:\nCombine chiles and oil in an airtight container; season with salt and pepper. Cover and chill at least 1 hour.\nDO AHEAD: Chile oil can be made 1 week ahead. Keep chilled.	0
clxyfmxp0048rzq1dpa93eov0	clxyfmt8m03nozq1dw303m56a	Buttermilk Panna Cotta with Apricot and Candied Fennel	2024-06-28 08:29:37.428	 ['1 envelope unflavored powdered gelatin (about 2 1/2 teaspoons)'\n '2 3/4 cups heavy cream\n divided'\n '2/3 cup plus 3 tablespoons sugar'\n '3 cups buttermilk'\n '3/4 cup dried apricots\n preferably Californian\n finely chopped'\n '1 tablespoon fennel seeds']	Ingredients:\n ['1 envelope unflavored powdered gelatin (about 2 1/2 teaspoons)'\n '2 3/4 cups heavy cream\n divided'\n '2/3 cup plus 3 tablespoons sugar'\n '3 cups buttermilk'\n '3/4 cup dried apricots\n preferably Californian\n finely chopped'\n '1 tablespoon fennel seeds']\nRecipe:\nPlace 1/4 cup cold water in a small bowl. Sprinkle gelatin over; let stand 10 minutes.\nHeat 1/2 cup cream in a medium saucepan over medium heat until very warm (it will deactivate the gelatin if it gets too hot). Remove from heat, add gelatin and 2/3 cup sugar, and whisk until they are completely dissolved. Gradually stir in remaining 2 1/4 cups cream, then buttermilk. Divide among eight small bowls or 6-ounce ramekins and chill until set, at least 4 hours.\nMeanwhile, bring apricots, 2 tablespoons sugar, and 1 cup water to a boil in a small saucepan, reduce heat, and simmer, stirring occasionally, until thickened and jam-like, 2025 minutes. Let compote cool completely.\nBring remaining 1 tablespoon sugar and 2 tablespoons water to a boil in a small saucepan over medium-high heat and cook, swirling often, until thick and syrupy (do not let it take on any color), about 4 minutes. Add fennel seeds and reduce heat to medium. Cook, stirring constantly, until sugar starts to become dry and crystallized, about 2 minutes. Remove from heat and stir until sugar is completely dry and crystallized, about 1 minute longer. Transfer seeds to a small bowl; set aside.\nServe panna cotta topped with compote and candied fennel seeds.\nDO AHEAD: Panna cotta can be made 3 days ahead; cover and keep chilled. Compote can be made 1 week ahead; cover and chill.	0
clxyfmycr04c9zq1db7699ysx	clxyfmt8m03nozq1dw303m56a	Buttermilk Rye Crepes	2024-06-28 08:29:38.283	 ['2 large eggs'\n '1 large egg yolk'\n '3/4 cup buttermilk'\n '1/4 cup milk'\n '1/2 cup rye flour'\n '1/4 cup all-purpose flour'\n '1/4 teaspoons kosher salt'\n '2 tablespoons plus 4 teaspoons sugar'\n '1/4 cup unsalted butter\n melted\n plus 8 teaspoons\n room temperature'\n 'Lemon wedges (for serving)']	Ingredients:\n ['2 large eggs'\n '1 large egg yolk'\n '3/4 cup buttermilk'\n '1/4 cup milk'\n '1/2 cup rye flour'\n '1/4 cup all-purpose flour'\n '1/4 teaspoons kosher salt'\n '2 tablespoons plus 4 teaspoons sugar'\n '1/4 cup unsalted butter\n melted\n plus 8 teaspoons\n room temperature'\n 'Lemon wedges (for serving)']\nRecipe:\nBlend eggs, egg yolk, buttermilk, and milk in a blender until smooth. Add rye flour, all-purpose flour, salt, and 2 tablespoons sugar and blend well. With blender on low, gradually stream in melted butter. Strain batter through a fine-mesh sieve into a large measuring cup or medium bowl.\nHeat 1/2 teaspoon butter in a medium nonstick skillet over medium heat until foamy. Pour 1/4 cup batter into skillet and swirl to coat bottom of pan. Cook crepe until lacy and golden brown on one side, about 2 minutes. Carefully flip crepe and cook on other side until just cooked through, about 1 minute longer; transfer to a plate. Repeat 7 times with remaining batter and stack crepes, placing a piece of parchment paper between each as you go to prevent sticking (you should have about 8 crepes).\nJust before serving, heat 1 teaspoon butter in a large skillet over medium-high heat. Fold 2 crepes in half and place side by side in skillet; sprinkle with 1 teaspoon sugar total, then flip. Cook until sugar is beginning to caramelize, about 1 minute. Repeat with remaining crepes. Serve with lemons for squeezing over.\nDO AHEAD: Crepes can be made 2 days ahead. Cover and chill.	0
clxyfmz0d04gnzq1dpqc54g8x	clxyfmt8m03nozq1dw303m56a	Cabbage and Asian Pear Slaw	2024-06-28 08:29:39.133	 ['1/2 cup buttermilk'\n '2 tablespoons mayonnaise'\n '2 tablespoons sour cream'\n '1 tablespoon apple cider vinegar'\n '1 tablespoon chopped fresh chives\n plus more'\n '1/2 teaspoon poppy seeds\n plus more'\n 'Kosher salt and freshly ground black pepper'\n '1/2 small green cabbage\n shredded'\n '1 Asian pear\n julienned'\n '1/4 small red onion\n thinly sliced']	Ingredients:\n ['1/2 cup buttermilk'\n '2 tablespoons mayonnaise'\n '2 tablespoons sour cream'\n '1 tablespoon apple cider vinegar'\n '1 tablespoon chopped fresh chives\n plus more'\n '1/2 teaspoon poppy seeds\n plus more'\n 'Kosher salt and freshly ground black pepper'\n '1/2 small green cabbage\n shredded'\n '1 Asian pear\n julienned'\n '1/4 small red onion\n thinly sliced']\nRecipe:\nMix together buttermilk, mayonnaise, sour cream, vinegar, 1 tablespoon chives, and 1/2 teaspoon poppy seeds; season with salt and pepper. Toss with cabbage, pear, and onion; season with salt and pepper. Serve slaw topped with more chives and poppy seeds.	0
clxyfn0gk04q5zq1dfxn8zost	clxyfmtcm03odzq1dnqswjp5r	Corned Beef Hash	2024-06-28 08:29:41.011	 ['2 pounds uncooked corned beef brisket (about 1 small)\n rinsed\n trimmed if fatty\n spice packet discarded if included'\n '4 sprigs flat-leaf parsley'\n '3 bay leaves\n torn'\n '1 tablespoon black peppercorns'\n '1 tablespoon coriander seeds'\n '1 tablespoon yellow mustard seeds'\n '1 medium onion\n peeled\n halved through root'\n '1 large russet potato\n peeled\n halved crosswise'\n '1/4 cup chopped fresh flat-leaf parsley\n plus more for serving'\n 'Kosher salt\n freshly ground pepper'\n '4 tablespoons unsalted butter'\n '1 teaspoon distilled white vinegar'\n '4 large eggs'\n 'Chopped fresh chives (for serving)']	Ingredients:\n ['2 pounds uncooked corned beef brisket (about 1 small)\n rinsed\n trimmed if fatty\n spice packet discarded if included'\n '4 sprigs flat-leaf parsley'\n '3 bay leaves\n torn'\n '1 tablespoon black peppercorns'\n '1 tablespoon coriander seeds'\n '1 tablespoon yellow mustard seeds'\n '1 medium onion\n peeled\n halved through root'\n '1 large russet potato\n peeled\n halved crosswise'\n '1/4 cup chopped fresh flat-leaf parsley\n plus more for serving'\n 'Kosher salt\n freshly ground pepper'\n '4 tablespoons unsalted butter'\n '1 teaspoon distilled white vinegar'\n '4 large eggs'\n 'Chopped fresh chives (for serving)']\nRecipe:\nPlace corned beef in a large Dutch oven or other heavy pot and add water to cover by 1". Add parsley sprigs, bay leaves, peppercorns, coriander seeds, and mustard seeds. Bring to a boil; reduce heat, cover, and simmer, skimming surface often and adding more water to pot as needed to keep meat submerged, until corned beef is tender, 3 1/24 hours.\nAdd onion and potato to corned beef in pot and cook until vegetables are very tender, 2025 minutes. Remove onion and potato from pot. Let cool; wrap separately and chill. Let corned beef cool in cooking liquid. Transfer corned beef to an airtight container and add as much cooking liquid as will fit (at least 1 cup). Cover and chill. Discard any remaining aromatics and cooking liquid.\nDO AHEAD: Corned beef and vegetables can be cooked 2 days ahead; keep chilled until ready to use.\nRemove corned beef from cooking liquid and shred enough to measure 2 cups (reserve any remaining corned beef for sandwiches or snacking).\nPreheat oven to 200F. Thinly slice cooked onion and cut cooked potato into 1/2" pieces; toss in a large bowl with corned beef and 1/4 cup parsley. Moisten with cooking liquid if mixture is dry; season with salt and pepper.\nHeat 2 tablespoons butter in a medium nonstick skillet over medium heat. Add 1/2 of corned beef mixture and press into a pancake. Cook undisturbed until underside is brown and crisp, 68 minutes. Set a plate over pan and carefully invert pancake onto plate; slide back into pan, pressing back into shape if needed. Cook until second side is brown and crisp, 68 minutes. Transfer hash to a rimmed baking sheet (it may break up a little), tent with foil, and keep warm in oven until ready to serve. Repeat with remaining butter and corned beef mixture.\nMeanwhile, bring 2" water to a boil in a large saucepan; reduce heat to a gentle simmer and add vinegar. Crack an egg into a small bowl and gently slide egg into water. Repeat with remaining eggs, waiting until whites are opaque before adding the next (about 30 seconds apart). Poach until whites are set and yolks are still runny, about 3 minutes. Using a slotted spoon, transfer eggs as they are done to paper towels.\nServe eggs over hash, seasoned with salt and pepper and topped with chives and more parsley.\nDO AHEAD: Eggs can be poached 2 hours ahead; place in a bowl of ice water and chill. Reheat in barely simmering water 1 minute just before serving.	0
clxyfn53t05jfzq1d92r1feqx	clxyfmtcm03odzq1dnqswjp5r	Slow-Roasted Pork Shoulder with Mustard and Sage	2024-06-28 08:29:47.033	 ['1 skinless\n bone-in pork shoulder (Boston butt; 56 pounds)'\n 'Kosher salt\n freshly ground pepper'\n '1/2 cup Dijon mustard'\n '1/4 cup finely chopped fresh sage'\n '2 tablespoons finely chopped fresh marjoram'\n '4 garlic cloves\n finely chopped']	Ingredients:\n ['1 skinless\n bone-in pork shoulder (Boston butt; 56 pounds)'\n 'Kosher salt\n freshly ground pepper'\n '1/2 cup Dijon mustard'\n '1/4 cup finely chopped fresh sage'\n '2 tablespoons finely chopped fresh marjoram'\n '4 garlic cloves\n finely chopped']\nRecipe:\nPlace a rack in lower third of oven; preheat to 325F. Season pork with salt and pepper. Mix mustard, sage, marjoram, and garlic in a small bowl. Spread all over pork, working it into all the crevices.\nPlace pork, fat side up, on a rack set inside a roasting pan and roast, basting with pan juices about every hour and tenting with foil if pork browns too quickly, until pork is well browned and very tender, 56 hours (depending on size of pork shoulder).\nLet pork rest at least 10 minutes before serving (the meat should pull apart easily).	0
clxyfn8fq0645zq1djjuggy8a	clxyfmtcm03odzq1dnqswjp5r	Nutty Crunch Cookies	2024-06-28 08:29:51.35	 ['1 cup blanched hazelnuts'\n '1/2 cup unsalted\n roasted almonds'\n '1/2 cup (packed) light brown sugar'\n '1 teaspoon kosher salt'\n '1/2 vanilla bean\n split lengthwise\n or 1 teaspoon pure vanilla extract'\n '1 1/2 cups all-purpose flour'\n '1 cup (2 sticks) chilled unsalted butter\n cut into pieces']	Ingredients:\n ['1 cup blanched hazelnuts'\n '1/2 cup unsalted\n roasted almonds'\n '1/2 cup (packed) light brown sugar'\n '1 teaspoon kosher salt'\n '1/2 vanilla bean\n split lengthwise\n or 1 teaspoon pure vanilla extract'\n '1 1/2 cups all-purpose flour'\n '1 cup (2 sticks) chilled unsalted butter\n cut into pieces']\nRecipe:\nPreheat oven to 350F. Toast hazelnuts on a rimmed baking sheet, tossing occasionally, until golden brown, 810 minutes. Let cool.\nCombine almonds, brown sugar, salt, and 1/2 cup hazelnuts in a food processor. Scrape in seeds from vanilla bean; reserve pod for another use. Pulse until finely ground, then pulse in flour just to combine. Add butter; process until dough just comes together.\nRoll dough into 1" balls and place on parchment-lined baking sheets, spacing 2" apart. Flatten cookies to a little less than 1/2" thick. Coarsely chop remaining 1/2 cup hazelnuts and press gently into cookies.\nBake, rotating sheets halfway through, until cookies are golden brown, 1518 minutes. Transfer baking sheets to wire racks and let cookies cool completely.\nDO AHEAD: Cookies can be baked 5 days ahead. Store airtight at room temperature.	0
